(12, 19, 74, 'Semur Ikan Patin Goreng ', 'semur-ikan-patin-goreng-', '25000', '<p>Masakan semur memang sangat identik dengan masakan yang berkuah dan bercitarasa manis, karena menggunakan kecap manis ditambah beberapa bahan lainnya. Ikan patin menjadi salah satu pilihan pecinta kuliner karena memiliki dagingnya yang empuk dan gurih, selain itu juga ikan patin memiliki kandungan gizi yang baik bagi kesehatan yang tentunya dibutuhkan oleh tubuh, terlebih bagi anak yang mampu mencerdaskan otak anak. Makanan semur ikan patin goreng ini sangat cocok bagi anak- anak, karena dalam pembuatan semur ikan patin goreng ini tidak menggunakan bahan berupa cabai sehingga anak dapat mengkonsumsinya.</p>', 'semur-ikan-patin-goreng.JPG', 'bungkus', 0),
(13, 19, 74, 'Ikan Gurame Goreng Cabe Ijo', 'ikan-gurame-goreng-cabe-ijo', '27500', '<p>Ikan gurame ini memiliki bentuk yang khas serta memiliki dagingnya yang tebal, serta apabila dimasak daging ikan gurame ini sungguh enak dan lezat. Ikan Gurame memiliki banyak manfaatnya bagi kesehatan. Kandungan pada ikan gurame merupakan kaya akan protein, vitamin dan masih banyak lagi kandungan yang tentunya sangat dibutuhkan oleh tubuh kita.</p>', 'gurame-goreng-cabe-ijo.JPG', 'bungkus', 0),
(14, 19, 74, 'Sup Asam Pedas Ikan Kakap Merah', 'sup-asam-pedas-ikan-kakap-merah', '26000', '<p>Ikan kakap menjadi salah satu pilihan yang dicari, karena daging ikan kakap ini memiliki rasa yang gurih serta lembut kala dimasak. Selain rasa dari daging ikan kakap, ternyata ikan kakap ini memiliki segudang manfaat yang baik bagi kesehatan. Seperti kita tahu bahwa kandungan pada ikan terdapat protein yang tinggi terlebih pada ikan laut salah satunya ikan kakap merah ini.</p><p>Ikan kakap memang banyak sekali jenis serta bentuknya, seperti ikan kakap merah, ikan kakap putih, ikan kakap hitam dan juga ikan kakap lainnya.</p>', 'sup-asam-pedas-ikan-kakap.jpg', 'bungkus', 0),
