(4, 4, 61, 1512955658, 'Pentingnya Mengkonsumsi Ikan ', 'pentingnya-mengkonsumsi-ikan-', '<p style="text-align: justify;"><a href="https://bengkelikan.pratamatechnocraft.com">Bengkel Ikan&nbsp;</a>- Ikan merupakan salah satu dari beberapa makanan yang umum dan favorit &nbsp;untuk beberapa orang. Terdapat beberapa jenis ikan yang dapat kita &nbsp;jumpai. Salah satunya yaitu ikan air tawar. Beberapa ikan air tawar yang &nbsp;banyak digemari yaitu ikan lele, ikan mujair, ikan guramen, ikan mas, &nbsp;ikan gurame, ikan bawal dan ikan nila. Ikan inilah yang biasa &nbsp;dibudidayakan oleh pembudidaya. Ikan air tawar juga dapat hidup di &nbsp;sungai, waduk, danau, dan kolam. Untuk persediaanya pun tak pernah &nbsp;habis.</p><p style="text-align: justify;">Lantas bagaimana manfaat dari ikan air tawar ini? Kita contohkan saja &nbsp;ikan nila dan mujaer. Kedua ikan ini mengandung beragam zat yang baik &nbsp;bagi tubuh seperti omega 3, selenium, fosfor, kalium, vitamin B12, &nbsp;niasin/vitamin B-3, vitamin B6, dan asam pantotenat/vitamin B-5. Dari &nbsp;kandungan ikan air tawar ini, berarti manfaatnya juga banyak. &nbsp;Selanjutnya kami akan sajikan beragam manfaat ikan air tawar ini.</p><h4>Ikan Air Tawar bermanfaat untuk mengkekarkan otot</h4><p style="text-align: justify;">Ikan air tawar terdapat banyak mengandung protein di dalamnya. &nbsp;Protein ini memiliki fungsi untuk membantu proses pembentukan otot &nbsp;tubuh. Jadi bagi &nbsp;yang ingin memiliki otot tubuh yang kekar dan berisi &nbsp;harus mencukupi kebutuhan protein.</p><h4>Menjadi sumber energi tubuh</h4><p style="text-align: justify;">Kandungan protein di dalam ikan air tawar ini juga berfungsi sebagai &nbsp;sumber energi. Protein merupakan sumber makanan cadangan. Sehingga &nbsp;apabila karbohidrat dalam tubuh tidak ada, protein inilah sebagai &nbsp;gantinya yang akan di bakar menjadi energi.</p><h4>Memperlancar peredaran dalam darah</h4><p style="text-align: justify;">Ikan air tawar juga memiliki kandungan zat besi yang tinggi. Zat besi &nbsp;ini bermanfaat bagi kelancaran peredaran darah. Sehinga bermanfaat juga &nbsp;untuk membuat tubuh sehat dan segar bugar serta terhindar dari beragam &nbsp;penyakit seperti penyakit jantung, penyumbatan pembuluh darah serta &nbsp;serangan stroke.</p><h4>Menyeimbangkan kolesterol dalam tubuh</h4><p style="text-align: justify;">Jenis ikan air teawar mampu menurunkan kolesterol jahat. Ini &nbsp;disebabkan oleh kandungan lemak baik yang dimilikinya. Lemak ini mampu &nbsp;membantu menyeimbangkan kol</p><h4>Bermanfaat bagi kesehatan mata</h4><p style="text-align: justify;">Kesehatan mata juga dapat ditingkatkan dengan memakan ikan jenis air &nbsp;tawar ini. Hal ini dikarenakan ikan air tawar memiliki kandungan berupa &nbsp;vitamin A di dalamnya. Dengan mengkonsumsi vitamin A secara teratur, &nbsp;kita akan memiliki daya tahan tubuh yang lebih baik, terhindar dari &nbsp;berbagai penyakit mata seperti katarak dan rabun mata.</p><h4>Baik untuk tulang kita</h4><p style="text-align: justify;">Vitamin D juga terkandung di dalamnya. Apa sih manfaat vitamin D ini? &nbsp;Vitamin D berfungsi untuk mempertahankan struktur tulang kta. Sehingga &nbsp;membuat tulang lebih kuat dan tidak terkena osteoporosis. Berfungsi juga &nbsp;untuk menambah tinggi badan.</p><h4>Meningkatkan metabolisme tubuh</h4><p style="text-align: justify;">Metabolisme dalam tubuh bisa ditingkatkan dengan mengkonsumsi ikan &nbsp;air tawar. Bagi yang lagi menjalani diet, ikan air tawar mampu &nbsp;memperlancarnya.</p><h4>Mencegah gejala anemia</h4><p style="text-align: justify;">Zat besi dalam kandungannya, ini mampu untuk menghindari adanya &nbsp;penyakit anemia. Anemia atau kekurangan darah dapat membuat penderitanya &nbsp;merasa pusing, mual, lemas, mudah lelah dan serta rentan terhadap &nbsp;penyakit.</p><h4>Melindungi jantung kita</h4><p style="text-align: justify;">Ikan air tawar mengandung berbagai mineral dan vitamin yang baik bagi &nbsp;jantung. Dengan begitu kinerja jantung menjadi lebih optimal. Dapat &nbsp;terhindar pula dari penyakit jantung.</p><p style="text-align: justify;"><br></p><p>( sumber : <a href="http://www.seputarmanfaat.com/beragam-manfaat-ikan-air-tawar/">http://www.seputarmanfaat.com/beragam-manfaat-ikan-air-tawar/</a> )</p>', 'ikan-patin.jpg', 19),
(5, 4, 61, 1512958553, 'Jurus Pemerintah Genjot Produksi Ikan Hias Nasional', 'jurus-pemerintah-genjot-produksi-ikan-hias-nasional', '<p style="text-align: justify;">Pemerintah memberikan perhatian khusus terhadap keberagaman <a href="http://bisnis.liputan6.com/read/3122265/kkp-dan-polri-gagalkan-57-kali-penyelundupan-terumbu-karang" title="ikan hias">ikan hias</a> di Tanah Air. Hal ini dibuktikan dengan gelaran Pameran Ikan Hias Nusantara di ICE BSD, Tangerang Selatan, Banten yang berlangsung pada 1 hingga 3 Desember 2017.</p><p style="text-align: justify;">Deputi Bidang Sumber Daya Alam dan Jasa Kementerian Koordinator Bidang Kemaritiman Agung Kuswandono mengatakan, pemerintah telah menggelar pameran Nusatic 2017 sejak tahun lalu. Artinya Desember ini adalah gelaran kedua.</p><p style="text-align: justify;">&ldquo;Ini adalah pameran Nusatic (Nusantara Aquatic) yang ke-2 tahun 2017, pada 2016 pameran ini sudah ada tetapi pemerintah belum ikut campur,&rdquo; ungkapnya seperti dikutip dari keterangan tertulis, Minggu (3/12/2017).</p><p style="text-align: justify;">Menurut Agung, jenis ikan hias di Indonesia adalah terbesar di dunia, hanya saja belum terpamerkan. Untuk itu, jika ingin mengekspor ikan hias, harus melalui Singapura terlebih dahulu, sehingga Singapura menjadi terkenal.</p><p style="text-align: justify;">&ldquo;Ini tantangan besar. Untuk itu kita harus bekerja keras, Kementerian Koordinator bidang Kemaritiman dan Kementerian Kelautan dan Perikanan harus mendukung kegiatan ini. Sehingga ikan hias ini bisa jadi tonggak ekonomi di Indonesia, dan bisa mengangkat nama Indonesia di Internasional,&rdquo; tuturnya.</p><p style="text-align: justify;">Dalam gelaran di ICE BSD tersebut. terdapat sembilan kontes <a href="http://bisnis.liputan6.com/read/3122265/kkp-dan-polri-gagalkan-57-kali-penyelundupan-terumbu-karang" title="ikan hias">ikan hias</a> yang dipamerkan, di antaranya adalah ikan Koi, Ikan Louhan, Ikan Arwana, serta jenis lainnya. Pada acara inipun banyak wisatawan asing maupun lokal yang mengunjung. &ldquo;Mereka mengakui bahwa ini adalah pameran terbesar minimal di Asia,&rdquo; paparnya.</p><p style="text-align: justify;">Pameran seperti ini tak akan berhenti sampai di sini saja. Pasalnya, Kemenko Kemaritiman&nbsp;akan mengadakan pameran serupa di tahun-tahun selanjutnya dengan acara yang lebih luas lagi untuk menunjukkan bahwa Indonesia memang negara besar di bidang ikan hias.</p><p style="text-align: justify;">&ldquo;Kita ini negara kepulauan terbesar di dunia, dua pertiga area kita ini adalah lautan. Kita adalah negara tropis, ini saja sudah menunjukkan negara kita itu memiliki keragaman <a href="http://bisnis.liputan6.com/read/3122265/kkp-dan-polri-gagalkan-57-kali-penyelundupan-terumbu-karang" title="ikan hias">ikan hias</a> yang luar biasa. Hanya sekarang bagaimana mengelolanya, supaya kalau diambil tidak habis,&rdquo; imbuhnya.</p><p style="text-align: justify;">(sumber : <a href="bisnis.liputan6.com/read/3182970/jurus-pemerintah-genjot-produksi-ikan-hias-nasional">bisnis.liputan6.com/read/3182970/jurus-pemerintah-genjot-produksi-ikan-hias-nasional</a> )<br></p>', 'berita 1.jpg', 17),
(6, 4, 61, 1512958651, 'Empat dari 10 paus yang terdampar di Aceh gagal diselamatkan', 'empat-dari-10-paus-yang-terdampar-di-aceh-gagal-diselamatkan', '<p style="text-align: justify;">Enam dari sepuluh paus jenis sperma yang terdampar di perairan kawasan Ujong Batee, Kabupaten Aceh Besar, berhasil diselamatkan namun empat lainnya mati pada Selasa (14/11) pagi.</p><p style="text-align: justify;">Dwi Aryo Tjiptohandono, Marine &amp; Fisheries Campaign &amp; Communications Coordinator WWF Indonesia, mengatakan bahwa tujuh dari 10 paus berhasil diselamatkan pada hari Senin (13/11) namun satu kembali ke lepas pantai dan akhirnya tak selamat bersama tiga paus lainnya.</p><p style="text-align: justify;">Saat ini tim WWF juga memantau kondisi enam paus lainnya untuk memastikan bahwa mereka meneruskan perjalanan dan tidak menunggu empat paus yang sudah mati.</p><p style="text-align: justify;">&quot;Juga apabila ada kejanggalan yg disebabkan luka atau cidera yg mengakibatkan kembali terdampar&quot;, terang Dwi Aryo dari WWF Indonesia.</p><p style="text-align: justify;">Pada hari Senin, 10 ekor paus sperma terdampar di lepas pantai Aceh.</p><p style="text-align: justify;">Warga Aceh, para petugas berwenang, bersama nelayan dan berbagai relawan lain berupaya menyelamatkan mereka dengan memindahkan mereka kembali ke tengah laut dengan menggunakan berbagai cara, termasuk dengan perahu motor.</p><p style="text-align: justify;">Belum diketahui penyebab terdamparnya paus-paus itu namun Kepala Bidang Perairan Pesisir dan Pulau-pulau Kecil, Nurmahdi, mengatakan terdamparnya paus jenis sperma tersebut atas dugaan ada anggotanya yang sakit.</p><p style="text-align: justify;">&quot;Ini jenis ikan yang pergi secara berkelompok dan juga merupakan ikan yang setia, makanya terdampar dalam jumlah banyak,&quot; kata Nurmahdi, kepada Hidayatullah, seorang wartawan di Aceh yang melaporkan untuk BBC Indonesia.</p><p style="text-align: justify;">Kasus terdamparnya paus jenis sperma di Provinsi Aceh sebenarnya bukan yang pertama kali. Hal serupa terjadi pada pada akhir tahun 2016 lalu.</p><p style="text-align: justify;">Saksi mata Prada Riki -seorang aparat Koramil setempat- mengatakan mulanya terlihat dari jauh segerombolan ikan besar, dan tidak lama kemudian kelompok ikan itu semakin mendekat ke pesisir hingga terdampar ke kawasan pantai.</p><p style="text-align: justify;">&quot;Saya lihat pukul 09.00 WIB masih di tengah laut, namun pukul 10.00 WIB sudah terdampar dan saya langsung laporkan pada atasan,&quot; jelas Prada Riki.</p><p style="text-align: justify;">Sementara saksi mata lainnya, Gabriel -seorang siswa Sekolah Menengah Kejuruan Pelayaran Samudera Indonesia yang baru pertama kali melihat paus secara dekat- mengaku bersama teman-temannya sempat menarik satu ekor paus ke laut, namun tidak lama dia kembali lagi ke pantai untuk bergabung bersama kawanannya yang terjebak.</p><p style="text-align: justify;">Paus jenis sperma merupakan salah satu hewan mamalia terbesar di dunia, dengan pertumbuhannya bisa mencapai sepanjang 12 meter dan berat hingga 57 ton.</p><p style="text-align: justify;">sumber: ..................... <br></p>', 'paus_20171113_192633.jpg', 19),
(7, 21, 61, 1512958750, 'Menteri Susi Siap Bawa RI Rajai Pasar Ikan Hias Dunia', 'menteri-susi-siap-bawa-ri-rajai-pasar-ikan-hias-dunia', '<p>Menteri Kelautan dan Perikanan, Susi Pudjiastuti menyatakan Indonesia dapat merajai pasar <a href="http://bisnis.liputan6.com/read/3182970/jurus-pemerintah-genjot-produksi-ikan-hias-nasional" title="ikan hias">ikan hias</a> dunia, mengalahkan Singapura. Potensi ini didukung dengan data nilai dan volume ekspor ikan hias Indonesia ke sejumlah negara yang tumbuh positif setiap tahun.</p><p>&ldquo;Masa negara yang lebih besar 100 kali dari Singapura, pemasarannya harus bergantung dengan negara yang 100 kali lebih kecil dari kita,&quot; kata Susi dalam keterangan resminya di Jakarta, Selasa (5/12/2017).</p><p>Menteri Kelautan dan Perikanan, Susi Pudjiastuti menyatakan Indonesia dapat merajai pasar <a href="http://bisnis.liputan6.com/read/3182970/jurus-pemerintah-genjot-produksi-ikan-hias-nasional" title="ikan hias">ikan hias</a> dunia, mengalahkan Singapura. Potensi ini didukung dengan data nilai dan volume ekspor ikan hias Indonesia ke sejumlah negara yang tumbuh positif setiap tahun.</p><p>&ldquo;Masa negara yang lebih besar 100 kali dari Singapura, pemasarannya harus bergantung dengan negara yang 100 kali lebih kecil dari kita,&quot; kata Susi dalam keterangan resminya di Jakarta, Selasa (5/12/2017).</p>', 'berita 2.jpg', 18),
(9, 4, 61, 1512958976, 'Arwana Jardini, Si Cantik Asli Papua yang Mendunia', 'arwana-jardini-si-cantik-asli-papua-yang-mendunia', '<p>Indonesia memiliki keragaman hayati berlimpah, termasuk juga melimpahnya keberadaan <a href="http://www.liputan6.com/tag/ikan-hias">ikan hias</a>. Papua misalnya, pulau di ujung timur Indonesia memiliki ragam kekayaan alami ikan hias. Setidaknya terdapat dua jenis<a href="http://www.liputan6.com/tag/ikan-hias">&nbsp;ikan hias</a> asli Papua yang sudah terkenal di pasar nasional dan internasional, yakni ikan rainbow dan ikan arwana jardini.</p><p>Arwana jardini sering ditemukan di kawasan perairan Merauke. Sisik arwana jardini berkilauan sangat indah seperti mutiara jika terkena cahaya lampu dari sudut yang tepat. Karena itu, arwana jardini sering juga disebut sebagai arwana mutiara.</p><p>Dilihat dari bentuk fisiknya, jumlah baris sisik arwana jardini ada tujuh atau delapan baris. Ukuran sisik ikan arwana jardini lebih kecil dibandingkan arwana asia.</p><p>Corak warna dasar arwana jardini berwarna coklat dengan bintik-bintik keemasan pada bagian tengah sisiknya, bagian kepala, bagian sirip, dan bagian ekornya. Ada pola cincin melingkar seperti bulan sabit di tepi sisik berwarna hijau atau merah.</p><p>Ikan arwana asli Papua ini memiliki 2 varian, yakni <em>red pearl</em> dan <em>green pearl</em>. Varian <em>red pearl</em> mudah dikenali dari adanya ragam corak seperti garis bercoret berwarna merah muda di sekitar mata dan penutup insang.</p><p>Sedangkan pada varian <em>green pearl</em> warnanya lebih polos, ada sisik berbintik kehijauan dengan sirip berwarna abu-abu dan hitam. Beberapa spot putih dapat ditemukan pada bagian sirip punggung dan sirip anal.</p><p>Tak hanya ikan arwana jardini yang menjadi ikan cantik Papua memukaua dunia. Papua juga memiliki ikan rainbow endemik di sekitar danau Kurumoi dan danau Sentani.</p>', 'berita 3.jpg', 40),
(10, 21, 61, 1512959090, 'Perkembangan Sektor Perikanan Bikin "Surprise"', 'perkembangan-sektor-perikanan-bikin-surprise', '<p style="">Menteri Kelautan dan Perikanan &nbsp;<a href="http://indeks.kompas.com/tag/Susi-Pudjiastuti" target="_blank">Susi Pudjiastuti</a> mengungkapkan berbagai pencapaian sektor perikanan Indonesia saat ini.</p><p>&quot;Untuk pertama kali, neraca perdagangan perikanan Indonesia nomer &nbsp;satu di Asia Tenggara,&quot; ujarnya dalam acara Halal Bihalal Iluni UI di &nbsp;Jakarta, Sabtu (15/7/2017).</p><p>Selama ini, Indonesia selalu berada di bawah bayang-bayang Thailand &nbsp;dan Filipina dalam urusan ekspor ikan. Namun kondisinya sekarang &nbsp;berubah.</p><p style="">Kebijakan pemberantasan illegal fishing, moratorium kapal ikan eks &nbsp;asing dan larangan bongkar muat kapal di tengah laut, hingga penegakan &nbsp;hukum melalui penenggelaman kapal yang dilakukan Indonesia telah &nbsp;berimbas kepada sektor perikanan Thailand dan Filipina.</p><p>Hal ini meyakinkan Menteri Susi bahwa sektor perikanan kedua negara &nbsp;itu justru ditopang oleh ikan dari laut Indonesia. Saat ini tutur Susi, &nbsp;ekspor perikanan Indonesia naik 5 persen, sementara impor ikan justru &nbsp;turun 70 persen.</p><p>Stok ikan Indonesia juga naik dari 6,5 juta ton menjadi 12,6 juta &nbsp;ton. Nilai Tukar Nelayan (NTN) yang menjadi salah satu indikator &nbsp;kesejahteraan naik dari 104 menjadi 110.</p><p>Usaha perikanan tangkap juga kian menguntungkan lantaran Nilai Tukar Usaha Perikanan (NTUP) juga naik dari 102 menjadi 120.</p><p style="">Sementara, tutur perempuan asal Pangandaran Jawa Barat itu, konsumsi &nbsp;ikan nasional juga naik dari 36 kg menjadi 43 kg per orang. &quot;Surprise &nbsp;yang luar biasa,&quot; kata menteri nyentrik tersebut.</p><p style="">( sumber: <a href="http://bisniskeuangan.kompas.com/read/2017/07/15/163608326/perkembangan-sektor-perikanan-bikin-surprise-">http://bisniskeuangan.kompas.com/read/2017/07/15/163608326/perkembangan-sektor-perikanan-bikin-surprise-</a> )<br></p>', '1544201000.jpeg', 133),
(11, 18, 61, 1512960171, 'Bahaya Cantrang di Masa Depan: Ikan Habis dan Profesi Nelayan Lenyap', 'bahaya-cantrang-di-masa-depan-ikan-habis-dan-profesi-nelayan-lenyap', '<p><span data-offset-key="1vdgr-0-0" data-reactid="251"><span data-reactid="252" data-text="true">Kementerian Kelautan dan Perikanan melalui Direktorat Jenderal Perikanan Tangkap secara konsisten akan terus memberikan bantuan alat penangkap ikan ramah lingkungan. Cara ini digunakan tidak lain untuk menggantikan cantrang.</span></span></p><p style=""><span data-offset-key="2lmp1-0-0" data-reactid="255"><span data-reactid="256" data-text="true">Rencananya, pelarangan menangkap ikan dengan menggunakan cantrang akan diberlakukan mulai 31 Desember 2017. Pelarangan penggunaan alat tangkap cantrang sudah diatur dalam Peraturan Menteri No. 2/PERMEN-KP/2015. Cantrang masuk ke dalam kategori alat tangkap tak ramah lingkungan, sama seperti pukat hela (trawl) dan pukat tarik (seine net).&nbsp;</span></span></p><p style=""><span data-offset-key="74u5e-0-0" data-reactid="271"><span data-reactid="272" data-text="true">Dalam paparannya di Lamongan, Jawa Timur, Kamis (30/11), Direktur Jenderal Perikanan Tangkap KKP, Sjarief Widjaja menuturkan penggunaan alat tangkap ramah lingkungan penting agar sumber daya ikan tetap lestari dan nelayan dapat menangkap ikan secara berkelanjutan. Bila terus-terusan menggunakan cantrang maka sumber daya ikan menipis bahkan habis dan bukan tidak mungkin profesi nelayan hanya tinggal nama.</span></span></p><p><span data-offset-key="6oice-0-0" data-reactid="284"><span data-reactid="285" data-text="true">&ldquo;Kita tidak ingin nelayan hanya ada di generasi kita. Kalau ikan habis, profesi nelayan akan ikut habis,&rdquo; papar Sjarief.</span></span></p><p><span data-offset-key="aa6ef-0-0" data-reactid="288"><span data-reactid="289" data-text="true">Dia pun mengungkapkan, saat ini di beberapa wilayah perairan Indonesia, jumlah ketersediaan ikannya tidak banyak. Ketika nelayan melaut, hasilnya naik turun. Jarak tempuh nelayan saat melaut pun, semakin jauh.</span></span></p><p><span data-offset-key="a3c2d-0-0" data-reactid="292"><span data-reactid="293" data-text="true">&ldquo;Itu artinya persediaan di wilayah tersebut menipis. Kalau profesi nelayan habis, kita tidak bisa makan ikan,&rdquo; ucapnya.</span></span></p><p><span data-offset-key="fohsl-0-0" data-reactid="296"><span data-reactid="297" data-text="true">Oleh karena itu, dia berpesan agar nelayan beralih ke alat tangkap yang ramah lingkungan dan mau meninggalkan cantrang. Sebab cantrang menjaring seluruh ikan dari ukuran besar sampai yang sangat kecil.</span></span></p><p style=""><span data-offset-key="ejusn-0-0" data-reactid="300"><span data-reactid="301" data-text="true">&ldquo;Targetnya kita ingin rekan-rekan nelayan bisa mencari nafkah dengan cara yang ramah lingkungan, ini juga bukan untuk kepentingan kami,&rdquo; tutup Sjarief.</span></span></p><p style=""><br></p><p style="">( sumber: <a href="https://kumparan.com/@kumparannews/bahaya-cantrang-di-masa-depan-ikan-habis-dan-profesi-nelayan-lenyap">https://kumparan.com/@kumparannews/bahaya-cantrang-di-masa-depan-ikan-habis-dan-profesi-nelayan-lenyap</a> )<br></p>', 'x08bt5nc6crjib6jj7af.jpg', 51),
(12, 22, 61, 1512962941, 'Baru ! Olahan Ikan Nila Asam Pedas ....', 'baru--olahan-ikan-nila-asam-pedas-', '<p>Hay , Sobat Kuliner !!&nbsp;</p><p>Yuk Olah ikaN Nila jadi Ikan nila asam pedas !!</p><h2>Bahan-bahan</h2><p>&nbsp;Untuk 2 Porsi &nbsp;&nbsp;</p><p>&nbsp;1. 3 Ekor Ikan Nila yang sudah digoreng &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>2. 6 buah Cabe Merah &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>3. 1 buah Tomat &nbsp; &nbsp;</p><p>4. Secukupnya Tepung Maizena &nbsp;</p><p>5. Sesuai selera Wortel parut &nbsp; &nbsp; &nbsp;&nbsp;</p><p>6. Secukupnya Daun Bawang &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>7. 2 Siung Bawang merah &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>8. &nbsp;1 Siung Bawang putih &nbsp; &nbsp;</p><p>9. Sesuai selera Garam dan Penyedap &nbsp; &nbsp;</p><p style="">10. 2 sdm minyak</p><p>Langkah-Langkah &nbsp; &nbsp; &nbsp;</p><p style="">1. &nbsp;Blender cabe+tomat<br>blender bawang merah+putih<br>Sisihkan</p><p style="">2. Parut wortel atau potong memanjang<br>Iris daun bawang nya memanjang/sesuai selera</p><p style="">3. Tumis bawang merah+bawang putih<br>putih sampai harum<br>Tambahkan cabe+tomat dan daun bawang masak sampai matang</p><p style="">4. Tambahkan air secukupnya,beri garam n penyedap sesuai selera</p><p style="">5. Tambahkan tepung maizena yang sudah diencerkan,masukkan wortel<br>Aduk sebentar lalu angkat dan siramkan keatas ikan nila yang sudah di goreng.</p><p style=""><br>Selamat menikmati sobat !!!</p><p style=""><br></p><p style="">( sumber: <a href="https://cookpad.com/id/resep/260537-goreng-nila-saus-asam-pedas">https://cookpad.com/id/resep/260537-goreng-nila-saus-asam-pedas</a> )<br></p>', 'Ikan Nila Masak Saos.jpg', 45),
(16, 4, 61, 1515643404, 'Laut Lebih Luas, Mengapa Ekspor Ikan RI Kalah Dibanding Vietnam?', 'laut-lebih-luas-mengapa-ekspor-ikan-ri-kalah-dibanding-vietnam', '<p>Kinerja Kementerian Kelautan dan Perikanan (KKP) dalam beberapa hari ini menjadi sorotan. Khususnya mengenai ekspor perikanan yang mengalami titik terendah dalam lima tahun terakhir.</p><p>Padahal, selama ini, kebijakan pemberantasan kapal-kapal pencuri ikan yang dilakukan oleh Menteri KKP mampu menjadi tolak ukur bagi berbagai negara di dunia. Namun, selama tiga tahun ini, kebijakan tersebut belum terlihat maksimal dalam meningkatkan ekspor perikanan RI.</p><p>&quot;Industri perikanan Indonesia saat ini sudah tertinggal jauh dari Vietnam. Padahal lautan negara tersebut tak seluas Indonesia,&quot; kata Wakil Ketua Umum Kadin Kawasan Timur Indonesia H Andi Rukman Karumpa di Jakarta, Rabu (10/1/2018).</p><p>Sepanjang 2017, Vietnam mampu mengekspor ikan dan olahannya senilai US$ 8,3 miliar sedangkan Indonesia hanya separuhnya. Bahkan, ditambahakan Andi, Vietnam mampu membangun industri makanan olahan berbasis kelautan dan kemudian diekspor ke mancanegara.</p><p>&ldquo;Asosiasi pengusaha seafood-nya Vietnam (VASEP) bilang ke kita untuk ekspor seafoodbahan baku udang saja sebesar US$ 3,8 miliar nilai ekspornya tahun lalu. Artinya, industrilisasi negara yang jauh lebih kecil dari Sumatera ini sudah jalan dan kita makin ketinggalan,&rdquo; ucapnya dia.</p><p>Tak hanya dengan Vietnam, Indonesia juga tertinggal dari Papua Nugini untuk ekspor ikan tuna. Padahal, tahun 2012 ekspor ikan tuna Indonesia tiga kali lipat dari Papua Nugini.</p><p>Dari catatannya, saat ini ekspor Tuna Papua Nugini delapan kali lebih besar dari Indonesia. Tahun 2016 saja, negara tetangga Indonesia itu berhasil ekspor 872.744 ton, sedangkan Indonesia hanya 115.953 ton. &quot;Kita kalah karena peralatan kapal kita bobotnya 1.372 GT sedangkan kita hanya 91,5 GT,&quot; tutup dia.</p><p>Sebab itu, pihaknya meminta agar Menteri Susi segera fokus menjalankan Instruksi Presiden (Inpres) No. 7/2016 tentang Percepatan Pembangunan Industri Perikanan Nasional.</p><p><a href="http://bisnis.liputan6.com/read/3221347/laut-lebih-luas-mengapa-ekspor-ikan-ri-kalah-dibanding-vietnam?source=search">http://bisnis.liputan6.com/read/3221347/laut-lebih-luas-mengapa-ekspor-ikan-ri-kalah-dibanding-vietnam?source=search</a></p>', '004271500_1421040516-Ikan3.jpg', 13),
(17, 21, 61, 1515643634, 'Ekspor Perikanan RI Tercatat US$ 3,62 Miliar hingga Oktober', 'ekspor-perikanan-ri-tercatat-us-362-miliar-hingga-oktober', '<p>Ekspor perikanan Indonesia tercatat sebesar US$ 3,62 miliar hingga Oktober 2017. Angka tersebut naik 6,38 persen dibandingkan 2016 yang sebesar US$ 3,4 miliar.</p><p>Direktur Jenderal Penguatan Daya Saing Produk Kelautan dan Perikanan Nilanto Perbowo mengatakan, <a href="http://www.liputan6.com/tag/ekspor">ekspor</a> perikanan secara volume hingga kuartal III 2017 mencapai 862 ribu ton. Sedangkan pada total ekspor di 2016 sebesar 881 ribu ton.</p><p>&quot;Akhir tahun biasanya naik karena persiapan Natal dan Tahun Baru, setelah itu turun lagi,&quot; ujar dia di Kantor Kementerian Kelautan dan Perikanan (KKP), Jakarta, Jumat (15/12/2017).</p><p>Indonesia tercatat sebesar US$ 3,62 miliar hingga Oktober 2017. Angka tersebut naik 6,38 persen dibandingkan 2016 yang sebesar US$ 3,4 miliar.</p><p>Direktur Jenderal Penguatan Daya Saing Produk Kelautan dan Perikanan Nilanto Perbowo mengatakan, <a href="http://www.liputan6.com/tag/ekspor">ekspor</a> perikanan secara volume hingga kuartal III 2017 mencapai 862 ribu ton. Sedangkan pada total ekspor di 2016 sebesar 881 ribu ton.</p><p>&quot;Akhir tahun biasanya naik karena persiapan Natal dan Tahun Baru, setelah itu turun lagi,&quot; ujar dia di Kantor Kementerian Kelautan dan Perikanan (KKP), Jakarta, Jumat (15/12/2017).</p><p><br></p><p><a href="http://bisnis.liputan6.com/read/3197401/ekspor-perikanan-ri-tercatat-us-362-miliar-hingga-oktober?source=search">http://bisnis.liputan6.com/read/3197401/ekspor-perikanan-ri-tercatat-us-362-miliar-hingga-oktober?source=search</a></p>', '048572600_1458813604-2016324-Pelelangan-Ikan-Muara-Angke-Jakarta-FF4.jpg', 9),
(18, 21, 61, 1515643733, 'RI Bakal Jadi Eksportir Ikan Hias Terbesar di Dunia', 'ri-bakal-jadi-eksportir-ikan-hias-terbesar-di-dunia', '<p>Sebelumnya, Indonesia berpotensi untuk menjadi pemasok terbesar ikan hias ke pasar dunia. Hal ini lantaran kekayaan ikan hias yang dimiliki Indonesia dan tersebar seluruh wilayah laut nusantara.&lrm;</p><p>Deputi Bidang Koordinasi Sumber Daya Alam dan Jasa Kementerian Koordinator bidang Kemaritiman, Agung Kuswandono mengatakan, selama ini sentuhan pemerintah di bidang ikan hias relatif kecil. Ini karena hanya Kementerian Kelautan dan Perikanan saja yang mengurusi hal tersebut.</p><p>Dia menuturkan, mengurus industri ini bukan sekadar mengurusi ikan hiasnya. Karena ikan hias ini sudah bersifat internasional, maka industrinya harus benar-benar diurus pada skala internasional pula.</p><p>&quot;Kita mengurusi ikan hiasnya, kita urusi nelayan penangkapnya, kita urusi pembudidayaannya, kita urusi transportasinya karena ikan hias rawan mati dan mengangkutnya harus dengan metode khusus dan tidak bisa lama-lama, maka mengangkutnya menggunakan pesawat terbang,&quot; ujar dia di Jakarta, Sabtu 2 Desember 2017.</p><p>Potensi jenis ikan hias Indonesia sendiri dapat dilihat dari keragaman jenis ikan yang mendiami perairannya. Tercatat perairan tawar Indonesia dihuni oleh sedikitnya 1.248 jenis ikan dan 243 jenis di antaranya merupakan spesies endemik dan 122 jenis udang hias. Sedangkan di perairan laut Indonesia, terdapat sekitar 3.476 jenis ikan.</p><p>&quot;Pemanfaatan potensi ikan hias tersebut, tentunya dapat memberikan kontribusi nyata apabila dapat dimanfaatkan secara optimal untuk kepentingan masyarakat,&quot; kata dia.</p><p>Agung mengungkapkan, keanekaragaman ikan hias ini menjadikan Indonesia sebagai salah satu negara eksportir ikan hias dunia. Potensi pasar dan tren produksi ikan hias Indonesia memiliki prospek yang cukup menjanjikan jika ditinjau secara ekonomi.</p><p>Pada 2015, kontribusi Indonesia untuk nilai ekspor ikan hias air laut menduduki posisi ke-3 dunia, dengan nilai mencapai sekitar US$ 5,43 juta Sementara nilai ekspor ikan hias air tawar menduduki posisi ke 5 besar dunia, dengan nilai mencapai US$ 14,16 juta.</p><p>&quot;&lrm;Hal ini didukung juga dengan tersebarnya wilayah sentra produksi ikan hias Indonesia di 18 Provinsi di seluruh Indonesia. Potensi lainnya terlihat dari tren produksi ikan hias yang terus meningkat setiap tahunnya,&quot; ungkap dia.</p><p>Pada 2015 produksi ikan hias sekitar 1,31 milyar ekor dan diharapkan menjadi 2,5 miliar ekor pada 2019. Dalam kurun waktu sepuluh tahun terakhir, Indonesia terus bersaing dengan Singapura, Spanyol, Jepang, Ceko, Thailand dan Malaysia untuk menguasai pasar ikan hias dunia.</p><p>&quot;Kehadiran ikan hias Indonesia di tengah perdagangan ikan hias internasional itu dapat berkontribusi sebagai penyumbang devisa negara,&quot; ujar dia.</p><p><br></p><p><a href="http://bisnis.liputan6.com/read/3197401/ekspor-perikanan-ri-tercatat-us-362-miliar-hingga-oktober?source=search">http://bisnis.liputan6.com/read/3197401/ekspor-perikanan-ri-tercatat-us-362-miliar-hingga-oktober?source=search</a></p>', '025679800_1456452714-botia.jpg', 7),
(20, 21, 61, 1515644182, '17 Tahun Vakum, Maluku Utara Kembali Ekspor Produk Perikanan', '17-tahun-vakum-maluku-utara-kembali-ekspor-produk-perikanan', '<p><strong>TERNATE</strong> - Maluku Utara adalah provinsi yang menjadi salah satu sumber penghasil ikan terbesar di Indonesia, bahkan dunia. Namun sayangnya, selama tujuh belas tahun terakhir, ekspor produk perikanan yang berasal dari wilayah tangkap Maluku Utara tidak dapat dilakukan langsung dari provinsi tersebut, melainkan melalui Bitung, Makasar, Bali, dan Surabaya. Namun, tahun ini mimpi masyarakat Maluku Utara untuk dapat mengekspor produk perikanannya secara mandiri akhirnya terwujud.</p><p>Selama ini, devisa ekspor dan pendapatan asli daerah dari sektor perikanan masuk ke provinsi di luar Maluku Utara. Hal tersebut sangat disayangkan, karena itulah satu tahun terakhir ini, Bea Cukai berkoordinasi dengan Bank Indonesia Provinsi Maluku Utara, dan semua pihak terkait untuk menyakinkan para pelaku UMKM sektor perikanan untuk melakukan ekspor.&nbsp;</p><p>&quot;Bea Cukai berkoordinasi dengan BI Provinsi Maluku Utara, Dinas Kelautan dan Perikanan, Badan Karantina Provinsi Maluku Utara, dan didukung oleh beberapa BUMN seperti maskapai penerbangan dan perbankan, untuk meyakinkan para pelaku UMKM sektor perikanan Maluku Utara agar mulai mengekspor secara mandiri,&rdquo; ujar Kepala Kantor Bea Cukai Ternate, Musafak, saat melepas langsung pemberangkatan kapal KM Mentari, pengangkut kontener produk ikan, di Pelabuhan Tobelo Halmahera Utara, Selasa (24/10).</p><p>Dijelaskan Musafak, ekspor perdana ini dilakukan oleh CV Markindo Raya yang berdomisili di Desa Pale Tobelo. Komoditi yang diekspor, dengan negara tujuan Jepang, ialah berupa ikan asap kering (dried smoked fish) sebanyak 11.046 kilogram, dengan nilai devisa ekspor USD34,194 atau sekitar Rp460 Juta.&nbsp;</p><p>&ldquo;Eksportasi ini di bawah pengawasan Pos Bantu Bea Cukai Ternate dan telah menggunakan aplikasi pelayanan ekspor berbasis online yang dikembangkan Bea Cukai Ternate,&rdquo; ungkapnya.</p><p>Lebih lanjut Ia berharap dengan berjalannya ekspor dibidang perikanan, dapat mendorong perekonomian dan meningkatkan penerimaan daerah sehingga dapat menunjang pembangunan di Provinsi Maluku Utara.</p><p><br></p><p><a href="https://ekbis.sindonews.com/read/1251809/34/17-tahun-vakum-maluku-utara-kembali-ekspor-produk-perikanan-1508993324">https://ekbis.sindonews.com/read/1251809/34/17-tahun-vakum-maluku-utara-kembali-ekspor-produk-perikanan-1508993324</a></p>', '17-tahun-vakum-maluku-utara-kembali-ekspor-produk-perikanan-Dz9.jpg', 10),
(21, 4, 61, 1515644391, 'Susi Keluhkan Penyelundupan Bibit Lobster ke Luar Negeri', 'susi-keluhkan-penyelundupan-bibit-lobster-ke-luar-negeri', '<p><strong>JAKARTA</strong> - Menteri Kelautan dan Perikanan Susi Pudjiastuti mengeluhkan masih maraknya penyelundupan bibit lobster ke luar negeri. Hingga saat ini penyelundupan lobster masih kerap terjadi Meski berkali-kali digagalkan.&nbsp;</p><p>&quot;Secara keseluruhan kita berhasil membuat sumber daya laut kita meningkat tajam. Tetapi, masih ada penyelundupan bibit lobster ke luar negeri,&quot; ungkapnya saat paparan Tiga Tahun Pemerintahan Jokowi-JK di Bina Graha, Jakarta, Rabu (18/10/2017).</p><p>Susi memgakui, sebesar 65% bibit lobster dunia dihasilkan di Laut Sunda. Ironisnya, banyak yang masih melakukan penangkapan untuk diselundupkan ke luar negeri, khususnya ke Vietnam.</p><p>&quot;Sekarang tidak hanya pengepul yang ikut main, tetapi aparat yang awalnya menjaga, sekarang ikut main. Sebab, nilainya besar. Satu koper bibit lobster bisa senilai Rp1,5 miliar,&quot; ujar dia.</p><p>Susi menjelaskan, pada 2000 saat penangkapan bibit lobster di Laut Sunda dibiarkan, maka banyak negara yang melakukan penangkaran, salah satunya Vietnam. Bahkan, masih kata Susi, nilai ekspor lobster Vietnam sebesar Rp500 miliar, itu semuanya diambil dari Laut Sunda. Karena memang Vietnam tidak memiliki sumber alam lobster.</p><p>&quot;Tahun ini saja lolos 60 juta ekor bibit lobster. Jumlah itu menjadi nilai luar biasa saat panen. Makanya, ekspor lobster Vietnam 100 kali lebih bayak dari Indonesia. Padahal, mereka tidak punya lobster,&quot; jelas Susi.</p><p>Akibatnya, hal tersebut menjadi ancaman nelayan Tanah Air dan jika dibiarkan, maka para nelayan tidak mendapatkan lobster lagi. &quot;Satu nelayan mendapat 10 kilogram lobster sekarang susah. Padahal, satu kilonya bisa Rp1 juta. Makanya kalau 10 kilogram sama Rp10 juta,&quot; terangnya.&nbsp;</p><p><a href="https://ekbis.sindonews.com/read/1249471/34/susi-keluhkan-penyelundupan-bibit-lobster-ke-luar-negeri-1508312981/">https://ekbis.sindonews.com/read/1249471/34/susi-keluhkan-penyelundupan-bibit-lobster-ke-luar-negeri-1508312981/</a></p>', 'susi-keluhkan-penyelundupan-bibit-lobster-ke-luar-negeri-df8.jpg', 14),
(22, 4, 61, 1515644550, 'Indonesia Miliki Potensi Ikan Tuna Terbesar Dunia', 'indonesia-miliki-potensi-ikan-tuna-terbesar-dunia', '<p><strong>YOGYAKARTA</strong> - Indonesia memiliki potensi ikan tuna yang melimpah. Berada di perbatasan antara Samudera Pasifik dan Samudera Hindia, Indonesia berpeluang menjadi yang terbesar dalam memproduksi ikan tuna dunia. Hanya saja, produksi yang ada belum optimal. Kontribusinya baru sebesar 16 persen dari 7,7 juta metric ton ikan tuna dunia.</p><p>&ldquo;Pemanfaatan kuota tuna sirip biru selatan Indonesia pada 2017 sebesar 750 ton. Sedangkan per September 2017, baru 288 ton,&rdquo; jelas Direktur Pengelolaan Sumber Daya Ikan Ditjen Perikanan Tangkap, Kementerian Kelautan dan Perikanan (KKP) Reza Shah Pahlevi pada pertemuan The 24th Annual Meeting of The Commission for The Conservation of Southern Bluefin Tuna (CCSBT) di Royal AmbarukmoH Hotel, kemarin.</p><p>Pertemuan dilaksanakan selama tiga hari, mulai Senin (9/10) sampai dengan Kamis (12/10). &nbsp;Berdasarkan data Food and Agriculture Oganization (FAO) dalam State of World Fisheries and Aquaculture (SOFIA) pada tahun 2016, Indonesia menyumbang hampir 16 persen atau 1.1 juta ton dari total sekitar 7,7 juta metrik ton tuna.&nbsp;</p><p>Ikan tuna termasuk kelompok jenis ikan yang beruaya jauh (highly migratory fish stocks/transboundary fish stocks) dan beruaya terbatas antara Zona Ekonomi Eksklusif Indonesia (ZEEI) dan laut lepas (straddling fish stocks).</p><p>Oleh karena itu, &nbsp;penanganan dan pengelolaan ikan ini dilaksanakan secara regional yang salah diwujudkan dalam Regional Fisheries Management Organization (RFMO). CCSBT, merupakan bagian dari program &nbsp;RFMO yang mempunyai kewenangan mengelola pemanfaatan tuna sirip biru selatan. Ada delapan Negara yang tergabung dalam CCSBT yakni, Australia, UE, Taiwan, Indonesia, Jepang, Korea Selatan, Selandia Baru dan Afrika Selatan, serta Philiphina &nbsp;(keanggotaan tidak penuh).</p><p>Tuna sirip biru selatan, kata Reza dikenal sebagai produk perikanan tuna yang memiliki nilai jual paling tinggi. &nbsp;Nilai ekspor produk tuna mencapai Rp.650 Milyar per tahun. &ldquo;Rata-rata produksi ikan baru sekitar 935 ton pertahun,&rdquo; jelasnya.</p><p>Rendahnya hasil tangkapan ini juga dipengaruhi, minimnya jumlah armada penangkap ikan. Pada tahun 2016 baru ada 226 kapal yang terdiri 84 kapal berukuran dibawah 30 GT dengan daerah penangkapan ikan meliputi wilayah ZEEI dan Laut Lepas Samudera Hindia. &nbsp; &nbsp;&nbsp;</p><p>Ketua Sidang The 24th Annual Meeting of CCSBT, Indra Jaya mengatakan perairan bagian selatan dilewati ikan tuna sirip biru. Secara ekonomi, nilai ini sangat tinggi, meski kuantitas terbatas. &ldquo;Ekspor ikan harus fresh. Sedangkan pelabuhan pangkalan laut lepas yang memungkinkan penangkapan masih di Pelabuhan Benoa, Bali,&rdquo; jelasnya.</p><p>Indra berharap ada kajian dan integrasi dalam system pengiriman dari bandara dengan penerbangan langsung. Dari Pelabuhan Benoa, baru bisa dikirimkan ke Australia maupun ke Jepang.</p><p><br></p><p><a href="https://ekbis.sindonews.com/read/1247216/34/indonesia-miliki-potensi-ikan-tuna-terbesar-dunia-1507648845">https://ekbis.sindonews.com/read/1247216/34/indonesia-miliki-potensi-ikan-tuna-terbesar-dunia-1507648845</a></p>', 'indonesia-miliki-potensi-ikan-tuna-terbesar-dunia-mDJ.jpg', 16);
INSERT INTO `budidaya_ikan` (`kd_budidaya`, `kd_ikan`, `deskripsi`, `budidaya`) VALUES
(4, 1, '<p style="">Ikan Mujair ( <em>Oreochromis mossambicus&nbsp;</em>) adalah salah satu ikan tawar konsumsi, ikan ini berasal dari Afrika dan menyebar pertama kalinya di Indonesia yang di temukan oleh Pak Mujair tahun 1939 di Jawa Timur. Ikan ini masih berfamily dengan ikan nila dan bentuknya pun hampir menyerupai ikan nila.</p>', '<p>Membudidayakan ikan mujair ini harus memperhatikan kondisi budidaya dan juga pengontrolan hama dan penyakit ikan mujair. Pembudidayaan ikan ini di lakukan dengan cara berupa pemilihan indukan, pemijahan, pemeliharan benih, pembesaran dan lainnya.</p><h3><strong>1. Pemilihan lokasi</strong></h3><p>Dalam penentukan lokasi yang baik untuk membudidayakan ikan mujair perhatikan persyaratan berikut ini :</p><ul><li>Jauh dari keramaian.</li><li>Memiliki aliran air yang bersih.</li><li>Media tanah yang bagus.</li><li>Mudah di jangkau.</li><li>Tidak semak dan jauh dari predator lainnya</li><li>Dan lain lain.</li></ul><h3 style=""><strong>2. Pengelolahan Media Kolam</strong></h3><p style="">Pembuatan media kolam budidaya ikan mujair dapat di budidayakan di terpal dan juga kolam tanah, serta kolam semen. Pembuatan kolam ikan mujair ini dapat di lakukan dengan cara antara lain :</p><ul><li>Jika sudah menentukan lokasi buat kolam dengan ukuran 50 x 50 x 100 meter persegi bahkan lebih tergantung pemilik.</li><li>Jika sudah di ukur lakukan pencangkulan atau pembuatan lubang dengan ukuran yang sudah di tentukan.</li><li>Lalu, lakukan pengapuran selama 2-3 minggu hingga kering ( jika menggunakan kolam dari tanah ). Jika tidak maka membuat kolam dengan terpal dengan ukuran yang sesuai dengan kolam yang di tentukan.</li><li>Setelah melakukan pengeringan dan pengapuran, diamkan selama 4-5 hari. Sebelum penebaran benih pembesaran.</li><li>Jika sudah, lakukan penebaran benih dengan kepadatan 400-450 perekornya.</li></ul><h3><strong>Pembenihan Ikan Mujair</strong></h3><p>Pembenihan ini sebaiknya tidak di lakukan, di karena sangat memakan waktu yang panjang. Sebaiknya pembenihan ikan mujair di beli di tempat pembenihan ikan terkait. Pemilihan benih harus sesuai dengan persyaratan antara lain :</p><ul><li>Berasal dari indukan berkualitas.</li><li>Pertumbuhan cepat.</li><li>Tidak terserang hama dan penyakit.</li><li>Tidak abnormal ( cacat )</li><li>Memiliki gerakan yang lincah.</li><li>Dan warna yang sangat cerah.</li></ul><h3><strong>Pemeliharaan Ikan Mujair</strong></h3><p>Pemeliharan ikan mujair ini di lakukan dengan mudah berupa pemberian pakan, pergantian air, hama dan penyakit dan juga penyiangan kolam ( pembersihan kolam ).</p><h4>a. Pemberian Pakan</h4><p>Pemberian pakan ikan mujair ini di lakukan 2 kali dalam sehari yaitu pada pagi dan sore hari. Pakan yang di gunakan pelet, bekatul dan juga pakan alami lainnya.</p><h4>b. Pergantian Air</h4><p>Pergantian air sangat penting di lakukan dengan teratur sekitar 2-3 minggu sekali. Hal ini di lakukan agar tidak terjadi penumpukan sisa makanan, yang menyebabkan berbagai penyakit yang datang di dalam kolam.</p><h4>c. hama dan penyakit</h4><p>hama dan penyakit ikan mujair sangat mempengaruhi pertumbuhan dan perkembangan ikan. Oleh karena itu, harus melakukan pengendalian hama dan penyakit ini dengan cara melakukan penyuntikan, pemberian nutrisi dan merendam ikan dalam larutan.</p><h3 style=""><strong>3. Pemanenan Ikan Mujair</strong></h3><p style="">Pemanenan ikan mujair ini dapat di lakukan dengan 4-5 bulan, setelah melakukan penebaran benih ikan mujair. Pemanenan ikan mujair dapat di lakukan dengan cara melakukan pengeringan kolam, penjaringan dan juga melakukan penangkapan. Lalu lakukan pemasaran dan juga pengemasan dengan bantuan oksigen atau tidak.</p><p style=""><br></p><p style=""><br></p>'),
(5, 2, '<p style="">Ikan Belida merupakan jenis ikan sungai yang termasuk dalam golongan suku Notopteridae ikan berpunggung pisau) Ikan lopis lebih dikenal dengan nama belida/belido yang di ambil dari salah satu nama sungai yang terdapat di Sumatra selatan sebagai tempat habitatnya. Di Kalimantan Selatan dan Kalimantan Tengah ikan belida disebut ikan pipih karena bentuk badannya yang pipih. Ikan ini merupakan bahan baku untuk sejenis kerupuk khas dari Palembang yang dikenal sebagai kemplang.</p>', '<p>Berikut Ini beberapa cara dan tips dalam memelihara dan budidaya ikan belida.</p><h2>1. Menyiapkan Kolam/Tempat Pemeliharaan</h2><p>Ikan Belida dewasa berukuran 1,5-7 kg, oleh karena itu ikan ini butuh area yang cukup luas dengan oksigen yang cukup. Disarankan untuk menggunakan kolam yang besarnya kira-kira 2 x 1,5 meter atau akuarium yang cukup besar dan berikan ketinggian air 30-45 cm. Dengan suhu rata-rata antara 20-30. Usahakan untuk menggunakan sistem air mengalir. Pisahkan Ikan belida kecil dengan ikan belida yg besar karena ikan karnivora ini dapat memiliki sifat kanibal.</p><h2>2. Pakan Ikan Belida</h2><ol><li>Ikan<br>Berikan pakan ikan yang lebih kecil daripada mulutnya atau hampir sama. Contoh : ikan mas,anakan ikan lele (pilih lele dumbo/lele hitam lainnya, jangan beri pakan dengan lele lokal, karena lele lokal memiliki patil yang lebih tajam daripada patil lele hitam lainnya).</li><li>Udang<br>Berikan pakan udang yang lebih kecil daripada mulutnya atau hampir sama.</li><li>Kodok<br>Pemberian pakan berupa katak/kodok hanya untuk belida dewasa</li></ol><h2 style="">3. Cara Budidaya Ikan Belida</h2><p>Sebelum melakukan budidaya, anda harus terlebih dahulu mengetahui jenis kelaminnya. Ikan Belida Betina memiliki sirip perut relatif pendek dan tidak menutup bagian urogenital, alat kelamin berbentuk bulat. Ketika birahi (matang gonad), bagian perut membesar dan kelamin memerah. Belida Jantan memiliki sirip perut lebih panjang dan menutup bagian urogenital, alat kelamin berbentuk tabung, ukuran lebih kecil daripada betina. Jika jantan siap pijah alat kelamin memerah dan mengeluarkan cairan putih (cairan sperma) jika ditekan/diurut.</p><p>Telur biasanya diletakkan di batang terendam pada kedalaman hingga 1m. Dalam rekayasa penangkaran, batang bambu atau papan dipakai sebagai tempat penempelan telur. Pemijahan dilakukan pada musim penghujan (di BBAT Agustus hingga Maret). Dalam sekali pemijahan, seekor betina rata-rata menghasilkan 288 butir telur, meskipun dapat menghasilkan hampir dua kali lipat dari jumlah itu. Derajat pembuahan berkisar 30-100 %. Derajat penetasan 72,2% dan sintasan (survival rate) larva adalah 64,2%. Larva menetas sekitar 72-120 jam (3-5 hari) pada suhu air 29-30 &deg;C.</p><p>Baca Juga : <a href="http://duniaair.com/budidaya-cacing-sutra/" rel="noopener noreferrer" target="_blank">Budidaya Cacing Sutra (Tubifex Sp)</a></p><p style="">Larva bersifat kanibal sehingga perlu perlindungan. Benih berusia 3 hari sudah mulai dapat makan udang artemia. Benih berusia satu bulan sudah dapat dideder di akuarium, dan satu bulan kemudian siap dideder di kolam. Ikan dengan ukuran 15cm siap untuk pembesaran.</p>'),
(6, 3, '<h5 style="">Ikan Betok adalah spesies ikan air tawar yang banyak dijumpai di Asia Tenggara. Ikan ini memilliki nama ilmiah yaitu <em>Anabas testudineus</em>(Bloch,1792) dan dalam bahasa inggris ikan betok dikenal dengan nama Climbing gouramyatau Climbing perch karena kemampuannya memanjat ke daratan. Betok juga memiliki nama lain di berbagai daerah seperti di Jawa orang menyebutnya bethik, jika di Banjar orang menyebutnya pepuyu, dan dalam bahasa Melayu orang menyebutnya ikan puyu.</h5>', '<h4 style="">1. Persiapan Kolam Budidaya Ikan Betok</h4><ol><li><h5>Proses Pengolahan Kolam Tanah / Beton</h5></li></ol><ul><li>Pengeringan</li></ul><p>Dilakukan dengan tujuan untuk membersihkan kolam dari sisa budidaya sebelumnya dan mematikan bibit-bibit penyakit.</p><ul><li>Pengapuran</li></ul><p>Dilakukan menggunakan kapur Dolomit atau Zeolit dengan dosis 60 gr per m2 untuk mengembalikan tingkat kasaman tanah pada dasar kolam dan untuk mematikan bibit penyakit yang belum mati pada saat proses pengeringan.</p><ul><li>Perlakuan TON</li></ul><p>TON diberikan untuk menetralkan berbagai racun dan gas berbahaya akibat dari pembusukan bahan organik sisa budidaya sebelumnya. <a href="http://ptnasa.net/ton-tambak-organik-nusantara/">TON</a> diberikan menggunakan dosis 5 botol TON per 1 hektar tanah atau 25 gr ( 2 sdm) per 100 m2 persegi. Pupuk kandang juga dapat ditambahkan bersamaan dengan pemberian <a href="http://ptnasa.net/ton-tambak-organik-nusantara/">TON</a> untuk menambah kesuburan lahan.</p><ul><li>Pemasukan air</li></ul><p>Air dimasukkan secara bertahap, tahap pertama dimasukkan setinggi 30 cm dan dibiarkan selama 3-4 hari untuk memberikan waktu plankton untuk tumbuh. Plankton nantinya akan menjadi pakan alami ikan sidat.</p><ol start="2"><li><h5>Proses Pengolahan Kolam Terpal</h5></li></ol><p style="">Penggunaan kolam terpal bisa menghemat penggunaan lahan. Sehingga meskipun keadaan lahan kecil, Anda tetap bisa memaksimalkan hasil produksi ikan sidat. Berikut ini beberapa spesifikasi minimal yang harus diterapkan saat pembuatan kolam terpal :</p><ul><li>Ukuran ideal kolam terpal 2 x 7 x 0,7</li><li>Kedalaman air 40 cm</li><li>Menambahkan oksigen dengan pompa udara 12 lubang</li><li>Menggunakan mesin pompa air kolam untuk membuat air mengalir</li></ul><p>Kolam terpal memiliki banyak kelebihan dibandingkan kolam jenis lain, terlebih untuk budidaya ikan sidat. Beberapa kelebihan kolam terpal yaitu :</p><ul><li>Hasil budidaya ikan sidat pada kolam terpal cenderung tidak berbau tanah</li><li>Temperatur air pada kolam terpal cenderung stabil</li><li>Memanen ikan sidat terhitung lebih mudah</li><li>Dapat dibuat kolam mini untuk daerah yang minim air</li><li>Biaya pembuatan kolam terhitung lebih rendah</li><li>Kolam terpal mudah dibersihkan</li></ul><p>Untuk kolam terpal, beberapa persiapan yang harus dilakukan adalah :</p><ul><li>Membersihkan bak dari kotoran sisa budidaya sebelumnya</li><li>Penjemuran kolam agar kering dan mamtikan bibit penyakit</li><li>Pada kolam terpal, pemasukan air dapat langsung penuh dan segera diberi perlakuan TON dengan dosis yang sama.</li></ul><h4 style="">2. Pemijahan Ikan Betok</h4><p style="">Benih ikan betok ini diperoleh dari pemijahan indukan ikan betok jantan dan ikan betok betina. Untuk membedakan antara ikan jantan dan betina dapat dilihat dari fisiknya. Berikut adalah ciri-ciri ikan jantan dan betina:</p><ol><li>Jantan</li></ol><ul><li>Memiliki bentuk tubuh yang kecil</li><li>Memiliki kelamin yang memanjang</li><li>Dan memiliki gerakan yang lincah dan gesit</li></ul><ol start="2"><li>Betina</li></ol><ul><li>Memiliki bentuk tubuh yang lebih besar</li><li>Memiliki lubang kelamin dengan bentuk bulat</li><li>Serta memiliki gerakan yang agak lambat</li></ul><p style="">Pemijahan ikan betok ini biasanya dilakukan dengan cara buatan yaitu dengan cara kawin suntik. Dalam sekalimusim kawin, ikan betok dapat dipijahkan sebanyak 3 kali dengan menghasilkan sekitar 5. 000 hingga 15.000 butir telur. Pada suhu 260&deg; telur-telur akan menetas dalam kurun waktu 24 jam sedangkan pada suhu 300&deg;C telur-telur tersebut akan menetas dalam kurun waktu 12 jam. Setelah itu ikan dapat disebar ada kolam.</p><h4 style="">3.Pemeliharaan Anakan Ikan Betok Dan Penebaran Ikan Pada Kolam</h4><p style="">Anakan ikan yang baru menetas tidak perlu langsung diberi pakan karena iakan betok tersebut masih memiliki cadangan makanan pada kantongnya. Setelah ikan berumur sekitar 4 hari barulah anakan ikan tersebut diberi pakan dengan kuning telur. Pemberian pakan tersebut dilakukan secara rutin sebanyak 3 kali sehari hingga ikan tersebut berumur 14 hari.</p><p>Setelah berumur 14 hari, diberi pakan berupa pelet yang telah dihaluskan karena ini merupakan waktu kritis ikan betok. Pemberian pakan berupa pellet dilakukan hingga ikan berumur sekitar 2 bulan. Setelah 2 bulan barulah ikan betok dapat ditebar dalam kolam yang telah disiapkan.</p><h4 style="">4. Manajemen Pakan</h4><p style="">Pakan buatan untuk ikan betok perlu ditambah nutrisi pakan. setiap pemberian pakan buatan (pelet) dicampur dengan <a href="http://ptnasa.net/poc-nasa/">POC NASA</a> dan <a href="http://ptnasa.net/viterna-plus/">Viterna Plus</a> dengan dosis 1-2 cc per kg pakan dan dicampur air secukupnya. Metode ini untuk meningkatkan pertumbuhan dan ketahanan tubuh karena mengandung berbagai uncur mineral penting protein dan vitamin dalam jumlah yang optimal.</p><p style="">Untuk menjaga kualitas air agar kualitasnya selalu baik, perlu diaplikasikan <a href="http://ptnasa.net/ton-tambak-organik-nusantara/">pupuk TON</a>. Pupuk TON mengandung unsur-unsur mineral penting, protein, lemak, karbohidrat dan asam humat yang bermanfaat untuk menyuburkan pakan alami berupa plankton dan cacing-cacingan dan menetralkan senyawa racun dalam kolam. <a href="http://ptnasa.net/ton-tambak-organik-nusantara/">Pupuk TON</a> diberikan pada saat olah lahan serta pada waktu pemasukan air baru atau minimal setiap 10 hari sekali dengan dilarutkan dan disiramkan pada permukaan tanah kolam. Dosis penggunaan TON yaitu 25 gram per 100 m2.</p><h4 style="">5. Pemanenan Ikan Betok</h4><p style="">Ikan betok dapat mulai dipanen setelah berumur sekitar 4 bulan. Namun pemanenan tersebut dapat dilakukan tergantung dengan kebutuhan pasar atau tujuan pemanenan tersebut apakah ikan tersebut akan dikonsumsi atau digunakan untuk produksi.</p><p style="">Ada 2 cara pemanenannya ini yaitu panen total dan panen selektif. Pemanenan total dilakukan tanpa memperhatikan ukuran iakan betok tersebut atau dipanen keseluruhan. Sedangkan pemanenan selektif dilakukan dengan cara di jaring kemudian ikan yang diambil adalah ikan yang telah siap panen dengan tujuan untuk mencari indukan ikan kembali dan juga untuk konsumsi.</p>'),
(7, 4, '<p>kan gabus merupakan salah satu jenis ikan air tawar yang banyak dijumpai di sungai dan rawa-rawa. Ikan gabus termasuk ikan predator atau kanibal karena bisa memangsa ikan-ikan lain yang ukurannya lebih kecil, serangga, serta kodok yang menjadi incaran makanannya.</p><p>Ikan gabus memiliki ciri tubuh bulat gilig memanjang seperti peluru kendali, berkepala besar agak gepeng seperti ular dengan sisik-sisik besar di atas kepala. Sehingga ikan ini dinamakan ikan <em>snakehead</em> (ikan kepala ular). Dalam bahasa Jawa ikan ini juga dinamakan ikan kutuk.</p><p style="">Ciri lain dari ikan ini adalah memiliki gerakan yang pasif, yaitu berpindah tempat yang satu ketempat yang lain lalu diam. Ikan gabus juga mampu bersembunyi dengan mengubur dirinya ke dalam lumpur untuk menghindari ancaman.</p>', '<h3>Langkah Langkah Ternak Ikan Gabus</h3><p>Setelah memperhatikan sekilas seluk beluk ikan gabus di atas serta peluang usahanya yang sangat menjanjikan, berikut ini saya uraikan bagaimana <strong>cara beternak ikan gabus dengan benar khususnya bagi pemula.</strong></p><ul><li><h4>Membuat kolam pemeliharaan/pembesaran</h4></li></ul><p>Sebelum kita melakukan budidaya ikan gabus, langkah pertama adalah membuat kolam pemeliharaan. Pada panduan ini saya memilih menggunakan kolam terpal karena memiliki beberapa keuntungan seperti biaya pembuatan murah, lebih tahan lama, serta mudah perawatannya.</p><p>Untuk membuat kolam terpal ada dua cara yang bisa kita pakai</p><p style=""><strong>pertama</strong>, dengan kolam terpal dinding tanah. Caranya dengan menggali tanah dengan ketinggian kurang lebih 2 meter, panjang 7 meter dan lebar 4 meter. Setelah jadi kemudian dipasang terpal dengan rapi.</p><p style=""><strong>kedua</strong>, kolam terpal kerangka bambu/besi. Caranya buat terlebih dahulu kerangka kolam menggunakan bambu atau besi dengan lebar 4 m, panjang 6 m dan tinggi 1,2 m. Kemudian pasang terpal dengan rapi. Jangan lupa untuk membuat saluran pembuangan menggunakan pipa paralon pada sisi dasar kolam.</p><p>Sebelum benih ditebar sebaiknya kolam dicuci terlebih dahulu menggunakan sabun untuk menghilangkan bahan kimia dan bau yang melekat pada terpal. Dan biarkan mengering hingga tiga hari.</p><ul><li><h4>Penebaran Bibit Ikan Gabus</h4></li></ul><p>Langkah selanjutnya adalah melakukan penebaran <strong>benih ikan gabus</strong>. Sebelum benih ikan gabus disebar, masukkan tanah bercampur kotoran hewan ke dalam kolam sampai setinggi 30 cm.</p><p>Kemudian masukkan air yang sudah diberi larutan Biodicon DF setinggi 50-100 cm. Lalu diamkan air selama 1 minggu, air jangan dialirkan agar tumbuh plankton sebagai makanan alami ikan.</p><p style="">Tebarkan bibit ikan gabus ke dalam kolam, dan jangan diberi makan selama 2 hari.</p><ul><li><h4>Pemberian Pakan Ikan Gabus</h4></li></ul><p>Dalam <strong>budidaya ikan gabus</strong>, pemberian pakan hendaknya memperhatikan hal-hal berikut:</p><ol><li>Berikan pakan secara rutin, karena sifat ikan gabus yang predator/kanibal. Sehingga jika telat memberi makan akan memakan ikan lain yang lebih kecil.</li><li>Dalam pemberian pakan, untuk ukuran 10.000 bibit ikan gabus membutuhkn sekitar 2kg pakan setiap harinya. Untuk pakan atau pelet ikan gabus hendaknya diperhatikan komposisinya. Komposisinya adalah lemak 15%, karbohidrat 10%, protein 15%,dan 60% sisa ampas dapur seperti anakan rayap,ikan teri, dan sisa daging.</li><li>Bisa juga kita membuat pakan lain dengan komposisi 50% dedak, 20% ikan teri, jagung 10%, dan ampas tahu 20%. Cara membuatnya, giling bahan tersebut menjadi satu, kemudian dijemur hingga kering. dan haluskan pakan sebelum diberikan.</li></ol><ul><li><h4>Panen Budidaya Ikan gabus</h4></li></ul><p>Tidak seperti ikan lele, nila, dan patin yang harus dipanen secara bersamaan. Ikan gabus dapat dipanen secara bertahap sesuai kebutuhan pasar. Ikan gabus memiliki daya tahan yang lebih tinggi sehingga jika dipanen bertahap tidak akan stres seperti lele atau patin.</p><p style="">Untuk mendapatkan hasil yang maksimal lakukan penyortiran ukuran secara rutin setiap 1 bulan sekali.</p>'),
(8, 5, '<p style="">Ikan arwana memiliki bentuk kepala yang besar dan padat. Bentuk tubuhnya pipih dengan punggung datar. Sisik pada badan besar dan keras, sedangkan kepala tidak bersisik. Giginya bertipe <em>canine</em> yang berjumlah 15-17. Sebagaimana ikan yang berasal dari <em>Osteichtyes</em>, arwana juga dilengkapi dengan tutup <em>operculum</em>. Letak sirip punggung hampir sejajar dengan pangkal ekor. Sirip dada panjang dan meruncing, bersisik besar mempunyai 2 sungut lunak pada ujung.</p>', '<h4><strong>Cara Budidaya Ikan Arwana</strong></h4><p><strong>a. Persiapan Media atau Akuarium Budidaya Ikan Arwana</strong><br>Sebelum melakukan budidaya ikan arwana sebaiknya siapkan dahulu media budidaya berupa akuarium. Jumlah akuarium yang akan digunakan untuk budidaya disesuaikan dengan kebutuhan, akuarium tersebut juga harus diberi perlengkapan seperti aerator, heater, filter air, pengatur suhu dan juga lampu.</p><p><strong>b. Pemilihan Jenis Ikan Arwana</strong><br>Jenis ikan arwana sangatlah banyak, maka disarankan anda untuk membudidayakan ikan arwana jenis super red karena jenis ini memiliki harga yang cukup tinggi yaitu sekitar 5 juta per ekor untuk ikan dewasa dan sekitar 1 juta per ekor unuk benihnya. Namun dirasa modal tidak memenuhi maka anda dapat melakukan budidaya jenis ikan arwana lain.</p><p><strong>c. Persiapan Indukan Ikan Arwana</strong><br>Ikan arwana yang akan dijadikan indukan sebaiknya ikan arwana yang berkualitas baik karena hal tersebut akan mempengaruhi hasil nantinya. Untuk membedakan antara ikan arwana jantan dan ikan arwana betina dapat dilihat dari ukuran tubuh dan kepalanya, jika ukuran tubuh dan kepala kecil berarti iakn tersebut adalah inkan arwana betina.</p><p style="">Ikan arwana yang dapat dijadikan indukan dan dikembang biakan adalah ikan yang telah mencapai umur sekitar 4 tahun lebih. Ikan yang telah dipilih menjadi indukan selanjutnya dipisahkan dengan arwana lain, selama dikembangbiakan ikan arwana tersebut diberi pakan khusus berupa udang.</p><p><strong>d. Waktu Pengembangbiakan Ikan Arwana</strong><br>Ikan arwana siap dikembang biakan ditandai dengan ikan tersebut telah menemukan pasangan, mereka sering berenang bersama dengan kepala dan ekor menempel.</p><p>Jika sudah seperti itu, ambil ikan tersebut dan tempatkan pada tempat atau akuarium perkembangbiakan. Selanjutnya ikan akan melakukan proses perkawinan, setelah itu betina akan bertelur. Ikan arwana jantan kemudian akan memakan telur yang dikeluarkan betina untuk membuahi telur tersebut hingga menjadi larva ikan. Setelah sekitar 2 bulan maka ikan jantan tersebut akan mengeluarkan larva ikan tersebut.</p><p><strong>e. Pembesaran Benih Ikan Arwana</strong><br>Benih ikan arwana yang telah memiliki ukuran sekitar 1 cm, diberi pakan berupa cacing pita dan juga nutrisi buatan lainyya hingga memiliki ukuran sekitar 12 cm. Setelah berukuran 12 cm maka benih tersebut dipisahkan dari indukan untuk menghindari benih termakan oleh indukan dan beri pakan ikan tersebut dengan ikan runcah atau udang kecil.</p><p style=""><strong>f. Pemanenan Ikan Arwana</strong><br>Jika ikan arwana telah memiliki ukuran sesuai dan telah memiliki warna yang bagus, ikan dapat dipanen dan dijual.</p>'),
(9, 6, '<p style="">Ikan black ghost merupakan hewan nokturnal atau aktif mencari makan pada malam hari. Ikan ini sangat sensitif terhadap cahaya sehingga pada siang hari ikan ini senang bersembunyi di bebatuan, ditempat &ndash; tempat yang gelap atau bersembunyi dibawah tumbuhan &ndash; tumbuhan air untuk menghindari sinar matahari. Untuk menangkap mangsanya, ikan black ghost akan mengeluarkan aliran listrik yang lemah dan berfrekuensi sekitar 0,1 &ndash; 10 kHz. Selain itu aliran listrik ini juga digunakan untuk mengenali objek sekitar tempat ia berada dan digunakan untuk berkomunikasi dengan sesama jenisnya.</p>', '<h2>Cara Budidaya Ikan Black Ghost</h2><p>Itulah sedikit pengenalan mengenai ikan Black Ghost yang sangat indah nan rupawan, dan kali ini kami situs <a href="http://www.budidayaikanhias.com/">Budidaya Ikan hias&nbsp;</a>akan memberikan panduan lengkap <a href="http://www.budidayaikanhias.com/2017/01/budidaya-ikan-black-ghost.html">Cara Budidaya Ikan Black Ghost</a> dengan mudah dan detail. langsung saja ya simak artikel ini secara detail berikut ini.</p><p><br></p><p><strong>1. Kualitas Air Yang Sesuai Untuk Budidaya Ikan Black Ghost</strong></p><p>Langkah pertama yang harus dilakukan untuk budidaya ikan black ghost adalah memperhatikan kualitas air yang terjaga, &nbsp;kualitas air dalam budidaya ikan black ghost haruslah cocok dengan kehidupan ikan black ghost agar perkembangan ikan tersebut lebih optimal dan agar tidak terjadi hal yang fatal.</p><p><br></p><p>Berdasarkan riset yang dilakukan seorang peneliti, budidaya ikan hias air tawar harus memiliki beberapa kriteria, air yang cocok untuk budidaya ikan black ghost adalah air dengan suhu 26-27 derajat celcius, dan &nbsp;pH air yang cocok 6 - 7 dan kekerasan 6 - 10 dH.</p><p><br></p><p><strong>2. Membedakan Ikan Jantan Dan Betina Untuk Budidaya Ikan Black Ghost</strong></p><p>Langkah kedua yang harus dilakukan seorang pembudidaya ikan black ghost adalah membedakan ikan jantan dan betina, tapi sebelumnya harus mengetahui ciri-ciri ikan black ghost jantan dan betina. untuk cirri Ikan black ghost jantan adalah Tubuh lebih besar, panjang, ramping, lurus dan gerakan lebih lincah, &nbsp;dan untuk Ikan black ghost betina berciri dengan Tubuh lebih kecil, pendek, gemuk, tidak lurus dan gerakanya tidak selincah jantan.</p><p><br></p><p>Ikan black ghost yang sudah siap untuk pemijahan, baik jantan maupun betina harus sudah berumur 1 tahun, adapun panjang tubuhnya hingga 20-30 cm.</p><p><br></p><p><strong>3. Pemeliharaan Induk Dalam Budidaya Ikan Black Ghost</strong></p><p>Langkah ketiga yang harus dilakukan adalah pemeliharaan indukan ikan black ghost, caranya dengan menyaipkan 2 buah akuarium dengan panjang 80cm, lebar 60cm, dan tinggi 40cm, satu untuk jantan dan yang satu untuk ikan betina. sebelumnya akuarium yang akan dijadikan untuk kehidupan ikan, akuarium dikeringkan terlebih dahulu selama 2 hari, kemudian di isi akuarium setinggi 30 cm. setelah itu pasang 2 titi aerasi untuk setiap akuarium dan dihidupkan selama pemeliharaan indukan.</p><p><br></p><p><strong>4. Budidaya Ikan Black Ghost Dengan Cara Pemijahan Induk &nbsp;Secara Berpasangan</strong></p><p>Langkah selanjutnya yaitu prosesi pemijahan yang dilakukan secara berpasangan berada pada akuarium yang telah di siapkan, berilah pakan tambahan berupa cacing darah (blood worm) dan jentik nyamuk secukupnya; pada sore hari, letakan 3 buah lempengan pakis panjang 20 cm dan lebar 10 cm (tempat bertelur) di atas dua paralon (seperti paranggong); letakan 10 &ndash; 15 kerikil untuk perlindungan telur dan sebagai pemberat.</p><p><br></p><p><strong>5. Budidaya Ikan Black &nbsp;Ghost Dengan Teknik Pemijahan Secara Masal<br></strong></p><p><br></p><p>Untuk budidaya ikan black Ghost dipijahkan secara masal di bak tembok atau fiberglass. dengan cara menyiapkan bak fibre glas dengan ukuran 2,5 m, lebar 1,5 m dan tinggi 0,5 m; keringkan selama selama 3 hari; isi air setinggi 30 cm; pasang 6 &ndash; 8 titik aerasi; masukan 20 potongan paralon 3 inchi sepanjang 30 cm; masukan masukan 12 ekor betina dan ekor jantan sejumlah 8 ekor.</p><p><br></p><p><strong>6. Penetasan Dan Pemeliharaan Larva Dalam Budidaya Ikan Black Ghost</strong></p><p>Selanjutnya proses penetasan dan pemeliharaan larva, telur ikan black ghost ditetaskan pada akuarium lain, tentunya dengan akuarium yang memiliki ukuran yang ideal. dalam kurun waktu 3 hingga 4 hari, telur ikan black ghost akan menetas dan larva tersebut akan berlindung diri di sela sela pakis.</p><p><br></p><p style="">Saat ikan menetas, akan berwarna putih dan secara perlahan akan berubah menjadi ikan yang berwarna hitam. selama 3 hingga 4 hari berilah pakan alami berupa naupli artemia atau pakan lainnya &nbsp;selama 2 minggu.</p><p>Selanjutnya setelah ikan berumur 2 minggu, ikan diberi pakan berupa jentik nyamuk atau cacing sutra , &nbsp;dilakukan dengan waktu selama kurang lebih 1 bulan.</p><p><br></p><p><strong>7. Pembesaran Ikan Dalam Budidaya Ikan Black Ghost</strong></p><p>Langkah ketujuh yaitu proses pembesaran ikan Black Ghost yang dilakukan pda akuarium, dengan cara menyiapkan kolam ikan yang ideal. masukkan 200 hingga 240 benih ikan black ghost, ukuran 1 hingga 1,5 inchi berasal dari tempat pemeliharaan larva. berilah pakan cacing darah ataupun tubifek ataupun jentik nyamuk. setiap 3 hari control kebersihan air, dang anti air saat sudah kotor.</p><p><br></p><p>Proses pembesaran ikan berlangsung selama 7 hingga 8 bulan, hingga memiliki ukuran 3 hingga 4 inchi dan siap dijual. kemudian langkah selanjutnya yaitu proses pemasaran. tidak &nbsp;perlu bingung dalam memasarkan ikan black ghost ini, karena ikan ini banyak yang tertarik.</p><p style=""><br></p>');
