INSERT INTO `threads` (`kd_thread`, `kd_user`, `kd_kategori`, `tgl_post`, `judul`, `judul_url`, `isi`, `gambar_headline`, `jumlah_view`) VALUES
(9, 65, 3, 1512958319, 'Pecinta ikan Komet masuk sini', 'pecinta-ikan-komet-masuk-sini', '<p>Sejarah</p><p>Ikan Mas Komet (Carassius Auratus) atau biasa dipanggil ikan komet memiliki ciri fisik yang sangat khas dari ikan lain, bentuknya yang sedikit agak memanjang dengan ekor yang biasanya panjang gemulai menjadi pembeda dari ikan lainnya.<br><br>Utuk asal mula munculnya ikan komet ada 2 versi, TS juga tidak tahu mana yang benar tapi keduanya akan ditampilkan kutipan artikelnya.<br><br><strong><u>Sejarah pertama:</u></strong><br>Ikan berpostur ramping ini pertama kali dibudidayakan oleh masyarakat Cina pada tahun 1729. Awalnya bentuk ikan komet ini seperti ikan maskoki. Karena kedua jenis ikan mas ini masih satu kerabat, yakni dari keluarga <em>Cyprinidae</em>. Pada zaman Dinasti Ming (tahun 1368-1644) popularitas ikan komet makin menanjak. Setelah itu, penyebaran ikan komet berkembang sampai ke Negeri Sakura.<br><br><strong><u>Sejarah kedua:</u></strong><br>Ikan komet dikembangkan di Amerika sekitar akhir abad ke-19. Nama komet diambil dari nama benda angkasa yaitu komet Halley. Ikan komet memiliki ketahanan tubuh yang lebih baik dibandingkan dengan ikan maskoki. Dengan harga yang murah, ikan komet banyak diminati oleh konsumen ikan hias.</p><p><br></p><p><strong>Perbedaan jantan dan betina</strong></p><p><strong><u>JANTAN</u><br>1. Badan ramping, terkesan kekar<br>2. Tutup insang kasar bila diraba (bila sudah dewasa/siap kimpoi)<br>3. Bila perut bawah dekat kelamin dipijat pelan akan keluar cairan putih<br>4. Menurut info lubang dubur jantan berbentuk lonjong<br>5. Ekornya panjang gemulai (katanya sih, masih belum ada cukup bukti)<br>6. Sang pengejar sambil menabrak pantat ikan lain (uda siap tempur <img src="https://s.kaskus.id/images/smilies/sumbangan/14.gif" border="0" alt="emoticon-Big Grin" title="Big Grin" class="fr-fic fr-dii">)<br><br><u>BETINA</u><br>1. Badan cenderung gemuk apalagi dibagian perut, tidak terlihat kekar<br>2. Tutup insang halus bila diraba<br>3. Bila perut bawah dekat kelamin dipijat pelan akan keluar oranye kemerahan, bila sudah siap kimpoi yang keluar adalah telur ikan<br>4. Menurut info lubang dubur betina berbentuk bulat<br>5. Ekornya agak pendek dan tidak gemulai (katanya sih)<br>6. Biasanya jadi korban yang dikejar-kejar, pantat nya di tabrak-tabrak</strong></p><p><br></p><p><strong>Tips dan Cara Membudidayakan Ikan Komet</strong></p><p>1. Wadah Pemijahan<br>Untuk wadah bisa menggunakan aquarium, kolam, bak fiber/terpal atau baskom besar. Wadah baiknya dicuci bersih dan pastikan bebas dari bakteri jahat yang bisa mengancam kesehatan ikan. Pastikan ukuran wadah sesuai dengan isi ikan yang akan di nikahkan, serta bila dirasa perlu, bisa ditambahkan aerator agar air kaya akan oksigen, siapa sih yang mau &quot;ehm-ehm&quot; di tempat yang sempit dan sesak <img src="https://s.kaskus.id/images/smilies/sumbangan/14.gif" border="0" alt="emoticon-Big Grin" title="Big Grin" class="fr-fic fr-dii"><br><br>2. Air<br>Pastikan air yang digunakan aman dan tidak mengandung zat berbahaya, misalnya air PAM sudah terkenal mengandung klorin yang bisa berbahaya buat ikan. Air bisa diendapkan dulu selama 24-48 jam, atau kalo males nunggu bisa pakai anti-klorin yang udah banyak dijual di pasaran<br><br>3. Media Pemijahan<br>Karena ikan komet adalah ikan yang meletakkan telur nya pada substrat maka perlu dpersiapkan media untuk ikan meletakan telurnya. Media yang bisa dipergunakan adalah tali rafia yang di-iris halus sehingga menyerupai akar tanaman lalu ditenggelamkan di air, atau bisa juga menggunakan tanaman air berakar cukup lebat seperti eceng gondok. Bila mau repot bisa bikin kakaban ijuk kayak para peternak ikan gede-an <img src="https://s.kaskus.id/images/smilies/sumbangan/14.gif" border="0" alt="emoticon-Big Grin" title="Big Grin" class="fr-fic fr-dii">. Pastikan juga media bebas dari bakteri berbahaya, caranya bisa direndam dengan obat mythlene blue (biasa disebut juga obat biru) untuk sterilisasi.<br><br>4. Pemilihan induk<br>Pilihlah jantan dan betina yang berkualitas baik bentuk tubuh maupun warna sehingga bisa diperoleh anakan yang ciamik juga. Ciri ikan yang siap kimpoi biasanya suka kejar-kejaran sambil cium-cium bokong (maaf <img src="https://s.kaskus.id/images/smilies/malus.gif" border="0" alt="emoticon-Malu (S)" title="Malu (S)" class="fr-fic fr-dii">) dan sudah cukup umur, biasanya umur 8 bulanan sudah bisa dipijah. Pastikan si betina sudah menyimpan telur dan si jantan bisa menghasilkan sperma (cara mengeceknya bisa diurut pelan pada perut.<br><br>5. Proses memijah<br>Biasanya rasio terbaik dalam memijahkan ikan adalah 1 Jantan : 2 Betina, selalu usahakan jangan memberi rasio jantan lebih banyak karena ada beberapa ikan bisa stress bila terus dikejar oleh para pejantan. Masukkan indukan terpilih ke wadah yang telah disiapkan dan jangan lupa media untuk meletakkan telurnya. Biasanya pemijahan si ikan akan berlangsung malam sampai dini hari, di alam liar pemijahan paling sering terjadi di musim hujan.<br>Pada pagi hari bisa dicek media pijahnya apakah sudah ada telur atau belum, bila sudah ada selamat anda sukses memijahkan ikan anda. Segera pindahkan indukan dari wadah agar tidak memakan telurnya sendiri, atau bisa juga media nya yang dipindahkan ke wadah penetasan yang sudah dipersiapkan dengan algae atau lumut yang bisa jadi pakan alami burayak ikan.</p><p>6. Penetasan telur dan pemeliharaan burayak (anak ikan)<br>Dalam waktu sekitar 2-3 hari biasanya telur akan mulai menetas, bila semua sudah menetas media pijah bisa diangkat. Larva ikan tidak perlu diberi makan selama 2-3 hari karena masih memiliki nutrisi dari kantung telur. Untuk pakan anak ikan biasanya bisa menggunakan kuning telur rebus (awas jangan terlalu banyak karena bisa mencemari air), pelet yang digiling halus, atau microworm. Berikan secukupnya saja jangan berlebihan. Menurut info yang saya baca di usia 2 minggu sebaiknya mulai ada sedikit pergantian air agar lebih sehat karena air sudah terlalu lama. Di usia sebulan biasanya bentuk dan warna anak ikan bisa mulai terlihat.</p><p><br></p><p><strong>Pakan untuk komet</strong></p><p><strong>Untuk pakan bisa menggunakan pellet yang tersedia di pasaran, misalnya takari, hokky, atau kalo punya dana bisa pakai punya tetra asal suntikan dananya kuat <img src="https://s.kaskus.id/images/smilies/malus.gif" border="0" alt="emoticon-Malu (S)" title="Malu (S)" class="fr-fic fr-dii"><br><br>Untuk yang mau kasih pakan hidup juga boleh seperti cuk (jentik nyamuk), cacing sutra, kutu air, dll. Penting untuk yang mau kasih pakan hidup sebaiknya pastikan pakan hidup steril dan tidak membawa bibit penyakit, bisa dicuci sampai bersih dengan air mengalir atau pakai mythlene blue. Solusi lain pakai pakan hidup yang udah diolah seperti cacing kering.</strong></p><p><br></p><p><br></p>', 'Screenshot_16a.jpg', 49),
(10, 66, 3, 1512959713, 'Jenis, Kualitas, Klasifikasi, Asal-Usul, Ciri Kualitas dari Ikan Lohan', 'jenis-kualitas-klasifikasi-asalusul-ciri-kualitas-dari-ikan-lohan', '<p><strong>Ikan Louhan -&nbsp;</strong>Ikan yang populer karena jenong atau nong-nong pada kepalanya. Bukan hanya itu, varian warnanya yang indah serta markingnya yang unik juga daya tarik dari ikan silangan ini.</p><p>Ternyata sampai saat ini ikan louhan masih memiliki penggemar setia, terbukti dari pengalaman saya ketika berkunjung di toko-toko ikan hias, ikan louhan masih laris-manis terjual.<br><br>Taukah anda jika ikan louhan sebenarnya bukan ikan asli yang pernah hidup di alam liar, ikan hias unik nan indah ini adalah hasil silangan. Mari kita lihat sejarah <strong>ikan louhan</strong> ini.</p><h3><strong>Klasifikasi Dan Asal - Usul Ikan Louhan</strong></h3><p>Ikan Louhan, berikut adalah klasifikasinya.<br><strong>Klasifikasi Ilmiah Ikan Louhan:</strong><br><br>Kerajaan: <em>Animalia</em><br>Filum: <em>Chordata</em><br>Kelas: <em>Actinopterygii</em><br>Ordo: <em>Perciformes</em><br>Famili: <em>Cichlidae</em><br>Genus: <em>Amphilophus</em><br>Spesies: <em>A. trimaculatus</em>&nbsp;</p><h3><strong>Asal - Usul Ikan Louhan</strong></h3><p><br>Ikan Louhan atau dalam bahasa inggris lebih populer dengan (<em>Flowerhorn</em>) adalah ikan hias air tawar yang terkenal dengan warna sisisk dan benjolan yang khas di bagian kepalanya yang sering disebut dengan jenong.<br><br>Jenong ikan louhan inilah daya tariknya, terutama orang negara Malaysia yang mana jenong ikan louhan dikenal dengan Karoi atau &quot;kapal perang&quot;. Berbeda orang dari negara Taiwan, mereka menyukainya karena louhan dianggap sebagai ikan hias hoki, akan tetapi harus louhan yang jenongnya besar dan bagus serta yang ekornya panjang.<br><br>Di tahun 1994, Ikan red devil ( Amphilouhus labiatus. Cichlasoma labiatum ) yang telah diimpor dari negara Amerika Tangah ke Negara Malaysia dan hasil dari hibrida parrot cichild yang diimpor dari negara Taiwan ke negara Malaysia yang dibesarkan secara bersamaan, yang pada akhirnya menandai kelahiran ikan louhan.<br><br>Di tahun 1995 perkawinan persilangan diadakan lebih lanjud dengan Human Face Red good of Fortune, yang akhirnya menghasilkan jenis ikan baru yang disebut Five-Colors God of Fortune.<br><br>Karena warna ikan hasil silangan ini sangat indah, akhirnya cepat menjadi populer. Penyempurnaan secara selektif terus berlanjut hingga pada tahun 1998, ketika Seven-Colors Blue Fiery Mouth (yang juga disebut sebagai Greenish Gold Tiger) yang diimpor dari Amerika Tengah, dan hasil perkawinan silangnya dengan Jin Gang Blood Parrot dari Taiwan. Pembelasteran ini akhirnya menghasilkan generasi pertama hibrida flowerhorn Hua Lou Han, yang kemudian diikuti dengan perkenalan flowerhorn berikutnya.<br><br>Ikan Louhan datang ke dunia barat yaitu pertama kali diimpor ke Amerika Serikat, hanya ada dua jenis ikan ini yang ditrisbusi, Flowerhorn dan Golden Base. Maka dari itu datanglah dua varietas, mereka dengan mutiara (binti-bintik perak putih pada sisik) dan yang tidak.<br><br>Sedangkan Ikan Louhan Golden Base juga memiki dua varietas, jenis yang pudar dan yang tidak pudar. Dari semua jenis ikan louhan yang tanpa mutiara dengan cepat disusul popularitasnya oleh ikan louhan yang memiliki mutiara, yang disebut dengan Zhen Zhu.<br><br>Jenis ikan louhan yang tersedia di pasar Amerika pada tahun 1999 ada empat jenis.<br><br>1. Ikan Louhan&nbsp;( Flowerhorn )&nbsp;Biasa<br>2. Ikan Louhan (&nbsp;Flowerhorn )&nbsp;Skala Mutiara<br>3.&nbsp;Ikan Louhan (&nbsp;Flowerhorn ) Emas<br>4.&nbsp;Ikan Louhan (&nbsp;Flowerhorn ) Fader<br><br>Peternak komersial pengembang biak, dan ikan yang dipilih untuk penampilan tanpa memperhatikan terminologi, akibatnya nama &nbsp;menjadi hal yang membingungkan dan akhirnya jenis keturunan ikan louhan menjadi sulit untuk dilacak.<br><br>Pada sekitar 2000-2001, munculah berbagai jenis louhan kamfa yang mana adalah hasil dari hibrida setiap jenis louhan yang disilangkan dengan spesies dari genus Vieja atau dengan Parrot Cichild jenis apapun. Yang akhirnya munculah sifat baru seperti mulut pendek, ekor terbungkus, mata cekung dan jenong yang makin besar dibagian kepala.<br><br>Melihat kejadian ini, para penangkar yang memebesarkan Zhen Zhu untuk mengembangkan lebih cepat dan menjadi lebih berwarna untuk bersaing dengan Louhan kamfa.</p><h3><strong>Ciri - Ciri Ikan Louhan yang Berkualitas</strong></h3><p>Ikan Louhan yang memiliki kualitas bagus berikut adalah ciri-cirinya:<br><br>1. Sirip atas dan bawah dan seimbang<br>2.&nbsp;Bintik hitam tegas dari pangkal ekor sampai insan<br>3.&nbsp;Lingkaran warna perak keemasan metalik melingkari bintik hitam<br>4.&nbsp;Tampak bintik mutiara hampir di seluruh badan<br>5.&nbsp;Warna dasar tubuh merah cerah dan kuning cerah<br>6.&nbsp;Sirip dan ekor merekah melebar dan utuh<br>7. Jenong di kepala tampak proporsional dan Mata merah satu lingkaran penuh.</p>', 'thread 1.jpg', 13),
(11, 66, 3, 1512961347, 'Yuk simak Bagaimana cara ternak Ikan GURAME yang MENJANJIKAN', 'yuk-simak-bagaimana-cara-ternak-ikan-gurame-yang-menjanjikan', '<p><strong>Ternak Ikan Gurame</strong> &ndash; Ikan gurame adalah salah satu jenis ikan yang memiliki prospek cerah jika dibudidayakan dengan baik. Terlebih lagi ikan gurame banyak diminati oleh masyarakat Indonesia karena mempunyai daging yang tebal dan sedap.</p><p>Ada banyak <strong>cara budidaya ikan gurame</strong> diantaranya: budidaya ikan gurame di kolam terpal, <a href="https://rejekinomplok.net/tag/budidaya/" target="_blank">budidaya</a> ikan gurame di kolam tembok, budidaya ikan gurame di kolam tanah dan lain-lain.</p><p>Karena pembudidayaan ikan gurame membutuhkan waktu yang lama sampai tiba masa penen, sehingga menyebabkan harga ikan gurame di pasaran menjadi mahal. Oleh karena itu pula ikan gurame dibut sebagai makanan yang elit, khususnya untuk ikan gurame yang mempunyai ukuran besar.</p><p>Namun, seiring dengan berkembangnya zaman, ternyata ada beberapa cara yang bisa membuat ikan gurame yang Anda budidayakan cepat besar dan cepat panen. Dan pada kesempatan ini, saya akan membahas tentang cara-cara yang bisa membuat ikan gurame yang Anda budidayakan cepat besar dan tentunya akan membuat Anda mempunyai keuntungan yang lebih besar pula.</p><h3>Tips-Tips Agar Ikan Gurame Anda Cepat Besar Dan Cepat Siap Panen</h3><p><br></p><ul><li><h4>Mencari Lokasi Yang Tepat Untuk Membuat Kolam</h4><img src="http://bengkelikan.pratamatechnocraft.com//uploads/90d3799e0d781ae44048eb6680075df7a278f1c5.jpg" style="width: 727px; height: 518.392px;" class="fr-fic fr-dib"></li></ul><p>Hal pertama yang harus Anda perhatikan agar bisa membuat ikan gurame Anda cepat tumbuh besar adalah lokasi pembuatan kolam. Kolam ikan gurame yang bagus dan baik yaitu kolam yang mendapatkan sinar matahari langsung yang cukup. Hal itu dikarenakan ikan gurame mempunyai habitat asli di tempat berdataran rendah yang mana suhunya sekitar 25 hingga 28 derajat celcius.</p><p>Jadi memilih lokasi kolam di dataran rendah lebih diutamakan daripada memilih lokasi kolam di dataran tinggi. Dan setelah diteliti lebih mendalam, ternyata ikan gurame akan cepat tumbuh besar di tempat yang memiliki ketinggian maksimal 800 meter di atas permukaan laut.</p><ul><li><h4>Memilih Benih Ikan Gurame Yang Sehat</h4></li></ul><h4><img src="http://bengkelikan.pratamatechnocraft.com//uploads/c76b0198fba301eea44edd4706d75175e6047dcf.jpg" style="width: 667px; height: 484.225px;" class="fr-fic fr-dib"></h4><p>Langkah selanjutnya adalah memilih benih ikan gurame yang sehat. Yang mana bisa dikategorikan sehat adalah ikan gurame yang memiliki berat sekitar 100 gram atau berumur lebih dari setahun.</p><p>Dengan mengikuti cara tersebut, Anda akan lebih cepat memanen ikan gurame yang mana biasanya akan siap jual atau panen ketika sudah memiliki berat sekitar 500 gram.</p><p>Selain itu, carilah benih ikan gurame tersebut di tempat yang tidak jauh dengan lokasi Anda membudidayakannya. Hal itu bertujuan agar benih ikan gurame yang Anda beli bisa lebih mudah beradaptasi dengan lingkungan barunya.</p><p>Karena bila tempat Anda membeli benih terlalu jauh dari tempat Anda, dikhawatirkan ikan gurame Anda mengalami kesulitan dalam beradaptasi dan bisa menyebabkan ikan gurame Anda mengalami stress dan kematian.</p><ul><li><h4>Mengeringkan Kolam Sebelum Memasukkan Benih Ikan Gurame</h4></li></ul><h4><img src="http://bengkelikan.pratamatechnocraft.com//uploads/0dc37669c49052918fa5115a648bbea247e952dc.jpg" class="fr-fic fr-dii"></h4><p>Cara yang selanjutnya adalah melakukan pengeringan kolam sebelum memasukkan benih gurame baru. Hal ini dilakukan agar benih ikan gurame Anda bisa terhindar dari serangan berbagai macam penyakit ikan gurame seperti jamur dan lain-lain.</p><p>Lakukanlah pengeringan kolam selama 10-14 hari dan berilah kapur pertanian sebanyak kurang lebih 200 gram per meter persegi. Selain itu, rendamlah semua peralatan yang Anda pakai untuk budidaya ikan gurame Anda ke dalam larutan kaporit kurang lebih setengah jam kemudian keringkan.</p><p>Bila Anda menemukan ikan gurame yang terserang penyakit, segera pisahkan dan rendamlah dalam larutan garam dapur sekitar 20 miligram per liter air selama satu jam.</p><ul><li><h4>Memberikan Pakan Yang Banyak Mengandung Protein Nabati Dan Protein Hewani</h4></li></ul><h4><img src="http://bengkelikan.pratamatechnocraft.com//uploads/383aa76ad460fa1644874b90f151a5f2004f5a78.jpg" style="width: 673px; height: 414.964px;" class="fr-fic fr-dib"></h4><p>Pakan yang bagus untuk ikan gurame adalah pakan yang mengandung banyak protein baik protein nabati maupun protein hewani. Oleh karena itu Anda sangat dianjurkan untuk memberi ikan gurame Anda dengan pakan yang memiliki kandungan dua protein tersebut.</p><p>Protein hewani merupakan kandungan protein yang bisa membuat ikan gurame Anda cepat tumbuh besar. Hal itu disebabkan ikan gurame membutuhkan setidaknya 25% protein hewani agar bisa cepat berkembang besar.</p><p>Sedangkan untuk protein nabati, Anda bisa memberikan makanan seperti daun kangkung, daun singkong, daun talas dan selada air kepada ikan gurame Anda. Selain itu, Anda juga bisa memberikan enzim komplek sekitar 2% dari pakan pabrik.</p><p>Nah, itulah beberapa cara agar ikan gurame Anda cepat tumbuh besar dan siap panen.&nbsp;</p><p>Semoga bermanfaat.</p>', 'budi-daya-ikan-gurame.jpg', 62),
(12, 65, 3, 1512962308, 'Share Kolam versi Agan disini', 'share-kolam-versi-agan-disini', '<p><img src="http://bengkelikan.pratamatechnocraft.com//uploads/553ea4e6d702e3660169e9dc1cab7f7859dff42a.gif" style="width: 300px;" class="fr-fic fr-dib"></p><p>Ini adalah kolam versi ane.</p><p><img src="http://bengkelikan.pratamatechnocraft.com//uploads/bd3e68efc053f28eade5d509671cc6cbe8c62d09.jpg" style="width: 300px;" class="fr-fic fr-dib"></p><p>Masih belum dipasang filter sih gann.. Masih setengah jadi, ada tangganya biar ada nuansa air di dalam rumah.. Rencana mau diisi ikan lele aja gan.. Biar gampang ngerawatnya <a href="javascript%3Avoid(0);"><img alt=":wakaka" src="https://s.kaskus.id/images/smilies/smilies_fb5ogiiief4q.gif" title="Wakaka" class="fr-fic fr-dii"></a><br></p><p>Yuk, share kolam agan dimari gann.. <a href="javascript%3Avoid(0);"><br><img src="https://s.kaskus.id/images/smilies/smilies_fbeqyos6i5nk.gif" alt=":shakehand2" title="Shakehand2" class="fr-fic fr-dii"></a><br></p>', 'kolam-ikan-koi-depan-rumah-1.jpg', 50),
(14, 66, 3, 1513040080, 'Budidaya Kutu Air dengan Kol tanpa bibit', 'budidaya-kutu-air-dengan-kol-tanpa-bibit', '<p>Jadi gini<br>Banyak kan yang tanya tanya gimana sih cara budidaya kutu air dengan kol tanpa bibit.<br>nahh.. yuk simak cerira ane berikut ini agar pengetahuan agan lebih luas :v</p><p>Jadi awalnya gini<br>kan ane punya ikan cupang nih tapi ane pingin kasih makan si cupang ane itu kutu air<br>kenapa?<br>kare dari kutu air itu dari artikel yang ane baca itu punya kandungan Protein yang tinggi yaitu 66% dan lemaknya sendiri itu 6% doang.<br>nah pasti sehat kan itu</p><p>Dari artikel tersebut jadi ane nyoba sendiri nih gimana ternak kutu air tanpa bibit</p><p><strong>Cara Budidaya Kutu Air&nbsp;</strong><strong>Yang Efektif Dan Tanpa Bibit</strong><br><br></p><p><img src="http://bengkelikan.pratamatechnocraft.com//uploads/fb252fd9d54ff9ec4354461032d4cbfd1b0fa064.png" style="width: 300px;" class="fr-fic fr-dib"></p><p>Sebetulnya ada banyak cara dalam membudidayakan kutu air ini mulai dari kotoran ayam, ampas kelapa, ampas kedelai, susu bubuk, sayuran dll.<br>tapi manurut ane nih cara budidaya kutu air itu menggunakan kol. karena hanya dengan kol yang dimasukan kewadah budidaya adalah cara membuat kutu air datang. itu berarti anda tidak susah - susah untuk beli bibit kutu air atupun mencarinya untuk mengkultur atau membudidayakanya.<br>Cara buat kutu air dengan kol ini sangatlah mudah, bahkan bahan-bahanya pun murah meriah alias geratis. Disamping itu cara ini juga tidak menggunakan aerator.</p><p>nah berikut ini langkah - langkahnya.</p><ol><li><strong>Siapkan Kol</strong><br>Sayur Kol bisa didapatkan dari pasar pasar bahkan bisa diambil dari tempat sampah disana yang keadaan sayur kolnya hampir busuk. Karena dengan keadaan hampir busuk tersebut jika dimasukan kedalam air maka akan mendatangkan kutu air dengan sangat cepat.</li><li><strong>Menyiapkan wadah untuk budidaya kutu air</strong><br>Wadah untuk budidaya kutu air dengan kol yang terpenting adalah lebar ataupun panjang tidak perlu yang tinggi.<br><br>Budidaya kutu air ini juga tergantung dengan budidaya ikan (cupang) anda<br><br>Jika ikan yang dibudidaya banyak maka di perlukan budidaya kutu air skala besar dan untuk itu perlu juga membuat kolam yang besar, baik itu kolam semen maupun kolam terpal.<br><br>Selama ini ane terus berupaya untuk menemukan cara budidaya kutu air yang efektif, bahkan menentukan wadah sekalipun. Dan pada akhirnya wadah yang admin pakai untuk ternak kutu air menggunakan bekas kulkas (almari es).</li><li><strong>Mengisi air untuk budidaya Kutu Air</strong><br>Masukan air yang sudah tua &quot; air yang sudah diendapkan&quot;, pengisian air ini secukupnya saja, yang terpenting tidak tinggi akan tetapi melebar ataupun memanjang seperti (kulkas).</li><li><strong>Masukan Kol</strong><br>Kol yang sudah sudah didapat bersihkan dahulu sebelum di masukan ke wadah budidaya. Agar supaya tidak jadi tempat bersarang dan bertelurnya nyamuk, maka wadah perlu di beri tutup.<br><br>Ane sendiri<strong>&nbsp;</strong>tidak memberi penutup dan itu sengaja admin lakukan agar nyamuk bertelur, karena admin butuh jentik nyamuk untuk pakan ikan cupang admin yang sudah besar.</li><li><strong>Tunggu Selama +- 1 minggu</strong><br>Biarkan selama kurang lebih satu minggu, dalam masa pembusukan kol, air akan berubah menjadi hitam....lama kelamaan air akan jernih kembali karena sudah mengendap, dan taraaaaa......<br>anda akan melihat beribu-ribu bahkan berjuta-juta kutu air.</li><li><strong>Pemanenan</strong><br>Ambil dengan saringan halus khusus kutu air, dan lakukan penkulturan secara kontinu agar siCupang selalu kenyang dan cepat besar.</li></ol><p data-empty="true">Mudahkan caranya??<br>So pasti mudah dan juga gratis lagi :v mwehehehehehe</p><p data-empty="true">Semoga bermanfaat gan dan sukses untuk budidayanya ya!</p>', 'bibit.png', 59);
